(9, 'CPU', 'Updating...', 'Hãng sản xuất: Intel\nChủng loại: Xeon® Gold 5220\nDòng CPU: Xeon\nTốc độ: 2.20 GHz turbo up 3.90 GHz\nBus Ram hỗ trợ: DDR4-2667\nNhân CPU: 18\nLuồng CPU: 36\nBộ nhớ đệm: 24.75 MB\nTập lệnh: Intel® SSE4.2, Intel® AVX, Intel® AVX2, Intel® AVX-512\nDây truyền công nghệ: 14 nm\nTDP: 125 W', 'CPU Intel Xeon Gold 5220', 45000000, 3.34831, 5, 45, '2021-07-02 20:50:24'),
(10, 'CPU', 'Mang đến cho người dùng trải nghiệm hiệu năng cao hơn, tiết kiệm chi phí và thời gian hơn nhờ những ứng dụng mạng của hệ thống dựa trên dòng bộ xử lý Intel® Xeon® Silver với khả năng ảo hóa được cải thiện nhờ phần cứng, đưa các Chức Năng Mạng Ảo Hóa lên một tầm cao hoàn toàn mới.', 'Hãng sản xuất: Intel\nChủng loại: Xeon® Silver 4208\nDòng CPU: Xeon\nTốc độ: 2.10 GHz turbo up 3.20 GHz\nBus Ram hỗ trợ: DDR4-2400\nNhân CPU: 8\nLuồng CPU: 16\nBộ nhớ đệm: 11MB\nTập lệnh: Intel® SSE4.2, Intel® AVX, Intel® AVX2, Intel® AVX-512\nDây truyền công nghệ: 14 nm\nTDP: 85 W', 'CPU Intel Xeon Silver 4208', 13000000, 2.64386, 5, 34, '2021-07-02 20:50:24'),
