(12, 'CPU', 'Updating...', ' Socket: LGA1151v2\n Bộ nhớ đệm: 12 MB\n Thuật in: 14nm\n Số nhân (Cores): 8\n Số luồng (Threads): 8\n Xung cơ bản: 3.0GHz\n Xung Turbo: 4.7GHz\n Điện tiêu thụ: 65W\n RAM tối đa: 128GB\n Loại RAM: DDR4-2666', 'CPU Intel Core i7 9700F', 8390000, 4.13438, 5, 57, '2021-07-02 20:50:24'),
(13, 'CPU', 'Intel Core i5 10600KA Avengers Edition là sản phẩm nằm trong chuỗi Collector Edition của tựa game Marvel’s Avengers.\nVỏ hộp của những chiếc CPU phiên bản Avengers được thiết kế bởi họa sĩ, nghệ sĩ đại chúng nổi tiếng Tristan Eaton sẽ đem lại một phiên bản giới hạn đặc sắc cho những fan của Marvel, đồng thời cũng mở ra cơ hội sở hữu cho những nhà sưu tầm muốn lưu lại những khoảnh khắc “đặc biệt” trong lịch sử phát triển của Intel.', 'Số hiệu Bộ xử lý: i5-10600KA\nTên sản phẩm: Intel Core i5 10600KA Avengers Edition\nSố lõi: 6\nSố luồng: 12\nTần số cơ sở của bộ xử lý: 4.10 GHz\nTần số turbo tối đa: 4.80 GHz\nBộ nhớ đệm: 12 MB Intel® Smart Cache\nBus Speed: 8 GT/s\nTDP: 125 W\nTần số TDP-down có thể cấu hình: 3.80 GHz\nTDP-down có thể cấu hình: 95 W\nDung lượng bộ nhớ tối Đa (tùy vào loại bộ nhớ): 128 GB\nCác loại bộ nhớ: DDR4-2666\nSố Kênh Bộ Nhớ Tối Đa: 2\nBăng thông bộ nhớ tối đa: 41.6 GB/s', 'CPU Intel Core i5 10600KA Avengers Edition', 7990000, 4.68397, 5, 30, '2021-07-02 20:50:24'),
