(19, 'CPU', 'Updating...', ' Socket: AM4\n Bộ nhớ đệm: 16MB\n Số nhân (Cores): 8\n Số luồng (Threads): 16\n Xung cơ bản: 3.2GHz\n Xung tối đa: 4.1GHz\n Điện tiêu thụ: 65W', 'CPU AMD Ryzen 7 2700', 8090000, 4.93769, 5, 45, '2021-07-02 20:50:24'),
(20, 'CPU', 'CPU AMD Ryzen 9 3900XT (3.8GHz Boost 4.7GHz | 12 Nhân / 24 Luồng | 64MB Cache | PCIe 4.0) là bộ vi xử lý có hiệu suất cực độ mà game thủ, streamer và người sáng tạo xứng đáng sở hữu.\nRyzen 9 3900XT với công nghệ AMD StoreMI là một công cụ mạnh mẽ cho những người đam mê PC muốn cải thiện thời gian tải, thời gian khởi động, quản lý tệp hoặc khả năng đáp ứng của hệ thống.', 'Sản Phẩm: CPU - Bộ vi xử lý\nHãng sản xuất: AMD\nModel: Ryzen 9 3900XT\nLoại sản phẩm: Bộ xử lý AMD Ryzen™\nDòng sản phẩm: Bộ xử lý AMD Ryzen™ 9\nSố nhân: 12\nSố luồng: 24\nXung cơ bản: 3,8GHz\nXung Max Boost: Lên đến 4.7GHz\nTổng bộ nhớ đệm L1: 768KB\nTổng bộ nhớ đệm L2: 6MB\nTổng bộ nhớ đệm L3: 64MB\nKhả năng ép xung: Có\nCMOS: TSMC 7nm FinFET\nSocket: AM4\nPhiên bản PCI Express®: PCIe 4.0\nTDP / TDP mặc định: 105W\nBUS bộ nhớ: 3200 MHz\nLoại bộ nhớ: DDR4\nKênh bộ nhớ: 2', 'CPU AMD Ryzen 9 3900XT', 12590000, 3.55388, 5, 41, '2021-07-02 20:50:24'),
