(61, 'Headphone', '', '- Hệ thống micro thích nghi thu âm giọng nói siêu việt, tiếp nhận và tách tiếng nói, đồng thời khử tiếng ồn xung quanh.\n- Thiết kế khung choàng đầu bằng thép không gỉ gọn nhẹ với chụp tai mềm, vừa vặn hoàn hảo. Mặt dưới khung choàng đầu có đệm xốp siêu mềm tạo cảm giác thoải mái \n- Thời lượng sạc pin chỉ tới 2.5 giờ, được sử dụng lên đến 20 giờ\n- Hỗ trợ ứng dụng Bose Music: Dễ dàng điều khiển tùy chỉnh', 'Tai nghe Bluetooth Bose Headphone 700', 10990000, 2.70883, 5, 46, '2021-07-02 20:50:24'),
(62, 'Headphone', '', '\n - Chứng nhận âm thanh Hi\n -Res \n - micro Arctis ClearCast mang lại khả năng xóa âm thanh chất lượng cao và khả năng khử tiếng ồn nền \n - trình điều khiển loa cao cấp \n - Kết nối không dây linh hoạt', 'Tai nghe không dây Over-ear SteelSeries Arctis Pro Wireless', 9290000, 4.12625, 5, 58, '2021-07-02 20:50:24'),
(63, 'Headphone', '', '- Kết nối: Bluetooth, NFC - Tích hợp Microphone, Công nghệ Acoustic Noise cancelling khử tiếng ồn, hỗ trợ jack 3.5mm - Thời gian nghe nhạc lên đến 20 giờ (không dây), 40 giờ (có dây) - Số lượng thiết bị kết nối: 1 - Loại pin: Lithium-Ion', 'Tai nghe không dây Over-ear Bose Quietcomfort 35 II', 8590000, 4.54541, 5, 12, '2021-07-02 20:50:24'),
(64, 'Headphone', '', '- trò chơi Tai Tai chơi trò chơi chơi trò chơi HyperX Cloud Orbit @ - Ba tổng hợp: USB A / USB Type-C / 3,5mm @ - Vi tính trong trò chơi có thể âm @thanh - Âm thanh 3D', 'Tai nghe HyperX Orbit', 7650000, 2.5477, 5, 45, '2021-07-02 20:50:24'),
(65, 'Headphone', '', '- Pure Adaptive Noise Canceling (Pure ANC) kích hoạt giúp loại bỏ tiếng ồn từ bên ngoài\n- Thời gian sử dụng lên đến 22 giờ chơi nhạc liên tục\n- Chip Apple W1 giúp tối ưu kết nối và hiệu suất pin\n- Nhận cuộc gọi, điều khiển nhạc, kích hoạt Siri trực tiếp trên tai nghe\n- Đệm tai nghe mềm giúp thoải mái trong thời gian dài sử dụng.', 'Tai nghe Beats Studio3 Wireless Headphones - Beats Camo Collection - Forest Green', 7290000, 3.73636, 5, 20, '2021-07-02 20:50:24'),
(66, 'Headphone', '', '- Âm thanh vòm 7.1 với tám màng loa ASUS Essence và loa siêu trầm ảo\n- Mic chống tiếng ồn công nghệ AI đem lại khả năng giao tiếp bằng giọng nói rõ ràng\n- DAC hi-res ESS 9601 và DAC 7.1 cấp độ nhà hát được tùy chỉnh độc đáo giúp mang đến âm thanh lossless đặc biệt \n- Đầu nối USB-C tương thích với máy tính PC, Mac, PS4, Nintendo Switch và các thiết bị thông minh \n- Phần mềm Armory II cho phép tùy chỉnh âm bass ảo và các cấu hình âm thanh khác', 'Tai nghe over-ear Asus ROG Theta ', 7090000, 3.57431, 5, 23, '2021-07-02 20:50:24'),
(67, 'Headphone', 'Trắng/Hộp sạc không dây', '- Phiên bản 2 với hộp sạc không dây\n- Chuẩn kết nối Bluetooth cực nhanh và ổn định \n- Thời lượng pin lên đến 5 giờ chơi nhạc và 3 giờ gọi thoại', 'Tai nghe không dây In-ear APPLE Airpod 2', 6990000, 4.78671, 5, 26, '2021-07-02 20:50:24'),
(68, 'Headphone', '', '- Tương thích đa nền tảng\n- 4 x 50mm củ loa âm thanh\n- Bộ điều chỉnh âm thanh trên dây\n- Jack 3.5 audio kết hợp\n- Dải tần đáp ứng: 100 – 10 kHz\n- Loại micrô: ECM', 'Tai nghe Over-ear Razer Tiamat V2', 5889000, 3.11392, 5, 35, '2021-07-02 20:50:24'),
(69, 'Headphone', '', '- Kết nối: Wirless (đầu thu USB) \n- Drive: 50mm / 32 Ohm \n- Thời gian sử dụng pin lên đến 20 giờ \n- Led RGB tích hợp \n- Âm thanh 7.1 Surround', 'Tai nghe không dây Corsair Virtuoso RGB Gunmetal', 5600000, 2.66545, 5, 15, '2021-07-02 20:50:24'),
(70, 'Headphone', '', '- Tai kiểu in-ear với ven điều áp \n- Chống ồn chủ động, cho âm thanh rõ hơn \n- Chế độ Transparency nghe âm thanh bên ngoài \n- Nghe nhạc 4.5 giờ, thoại 3.5 giờ \n- Kết nối Bluetooth 5.0 không dây tiện ích \n- Kháng nước, chống mồ hôi theo tiêu chuẩn IPX4', 'Tai nghe Bluetooth Apple Airpod Pro', 5549000, 2.99982, 5, 47, '2021-07-02 20:50:24'),
