(76, 'Headphone', '', '- Âm thanh vòm 7.1 với tám màng loa ASUS Essence và loa siêu trầm ảo\n- Mic chống tiếng ồn công nghệ AI đem lại khả năng giao tiếp bằng giọng nói rõ ràng\n- DAC hi-res ESS 9601 và DAC 7.1 cấp độ nhà hát được tùy chỉnh độc đáo giúp mang đến âm thanh lossless đặc biệt \n- Đầu nối USB-C tương thích với máy tính PC, Mac, PS4, Nintendo Switch và các thiết bị thông minh \n- Phần mềm Armory II cho phép tùy chỉnh âm bass ảo và các cấu hình âm thanh khác', 'Tai nghe over-ear Asus ROG Theta  ', 1090000, 0, 5, 4, '2021-07-02 20:50:24'),
(77, 'Headphone', 'Trắng/Hộp sạc không dây', '- Phiên bản 2 với hộp sạc không dây\n- Chuẩn kết nối Bluetooth cực nhanh và ổn định \n- Thời lượng pin lên đến 5 giờ chơi nhạc và 3 giờ gọi thoại', 'Tai nghe không dây In-ear APPLE Airpod 2 ', 4990000, 0, 5, 0, '2021-07-02 20:50:24'),
(78, 'Headphone', '', '- Tương thích đa nền tảng\n- 4 x 50mm củ loa âm thanh\n- Bộ điều chỉnh âm thanh trên dây\n- Jack 3.5 audio kết hợp\n- Dải tần đáp ứng: 100 – 10 kHz\n- Loại micrô: ECM', 'Tai nghe Over-ear Razer Tiamat V2 ', 8889000, 0, 5, 0, '2021-07-02 20:50:24'),
(79, 'Headphone', '', '- Kết nối: Wirless (đầu thu USB) \n- Drive: 50mm / 32 Ohm \n- Thời gian sử dụng pin lên đến 20 giờ \n- Led RGB tích hợp \n- Âm thanh 7.1 Surround', 'Tai nghe không dây Corsair Virtuoso RGB Gunmetal ', 2600000, 0, 5, 0, '2021-07-02 20:50:24'),
(80, 'Headphone', '', '- Tai kiểu in-ear với ven điều áp \n- Chống ồn chủ động, cho âm thanh rõ hơn \n- Chế độ Transparency nghe âm thanh bên ngoài \n- Nghe nhạc 4.5 giờ, thoại 3.5 giờ \n- Kết nối Bluetooth 5.0 không dây tiện ích \n- Kháng nước, chống mồ hôi theo tiêu chuẩn IPX4', 'Tai nghe Bluetooth Apple Airpod Pro ', 2549000, 0, 5, 0, '2021-07-02 20:50:24'),
(81, 'Keyboard', 'Bàn phím Leopold FC750RPD Graphite được trang bị switch Cherry đến từ Leopold mang đến cho người dùng cảm giác bấm gần như tốt nhất trên thị trường bàn phím cơ giá rẻ.\n\nCác switch được lựa chọn và sàng lọc kĩ càng, đem tới sự cân bằng lực nhấn giữa các phím bấm. Chưa hết, chất liệu nhựa keycap PBT Doubleshot cao cấp nhất hiện nay cũng góp phần tăng cảm giác thoải mái khi gõ phím.', 'Thương hiệu: Leopold\nKích cỡ: Tenkeyless\nSố lượng nút phím: 87\nChất liệu vỏ: Nhựa\nMàu sắc: Đen / xám\nKeycap: Thick PBT\nSwitch: Cherry Red\nLực nhấn (gr): 45\nKết nối: Dây cáp rời\nLoại dây: USB 2.0 Type-A\nKích thước (mm): 362 x 140 x 33\nLayout: ANSI\nKeycap: Phím Ctrl, Capslock thay thế\nKeypuller: 01 Ring keypuller', 'Bàn phím Leopold FC750RPD Graphite', 3150000, 4.94613, 5, 42, '2021-07-02 20:50:24'),
(82, 'Keyboard', 'Mẫu bàn phím cơ giá rẻ AKKO 3108 v2 Bilibili với phiên bản màu trung tính này mang đến một tone màu thu hút và tươi mát. Đơn giản nhưng lại bắt mắt!\n\nBàn phím AKKO 3108 v2 Bilibili (Akko switch) Với bộ Switch được thiết kế tỉ mỉ từng chi tiết với 3 lựa chọn (Blue/Orange/Pink). Phù hợp với hầu hết nhu cầu của người dùng. Chỉ cần thử một lần, chắc chắn bạn sẽ không thể gõ lại bàn phím thông thường được nữa.', 'Hãng sản xuất:Akko\nModel: 3087 (Tenkeyless, 87keys)\nKết nối: USB Type C, có thể tháo rời\nKích thước: 360 x 140 x 40mm\nHỗ trợ: NKRO\nKeycap:PBT Dye-Subbed, OEM profile\nLoại switch:Akko switch (Blue/Orange/Pink)\nTrợ năng:Hỗ trợ multimedia, macro và có thể khóa phím windows\n', 'Bàn phím AKKO 3108 v2', 1690000, 2.61309, 5, 8, '2021-07-02 20:50:24'),
(83, 'Keyboard', 'Keycap custom lấy chủ đạo là Ocean Star, đặc trưng của đại dương. Bàn phím cơ giá rẻ AKKO 3108 phiên bản cherry switch.\n\nSử dụng Cherry switch của Đức, độ bền 50 triệu lần bấm.\nKeycap PBT chất lượng cao, mô phỏng sóng biển tuyệt đẹp.\nKhông có Led\nCover chống bụi, keypuller thép, keycap trắng tặng kèm.\n', 'Hãng sản xuất:Akko\nModel: 3108 (Fullsize, 108 keys)\nKết nối: USB Type C, có thể tháo rời \nKích thước: 442 x 140 x 40mm\nHỗ trợ NKRO\nKeycap: PBT Double-Shot\nFont Được in ở mặt nghiêng của nút\nLoại switch:Cherry switch (Blue/Brown/Red)\nTrợ năng:Hỗ trợ multimedia, macro và có thể khóa phím windows\nPhụ kiện:\n1 sách hướng dẫn sử dụng\n1 keypuller\n1 cover che bụi\n1 dây cáp USBkeycap tặng kèm', 'Bàn phím AKKO 3108 SP', 1890000, 4.5416, 5, 35, '2021-07-02 20:50:24'),
(84, 'Keyboard', 'Bàn phím cơ Mistel Sleeker X-VIII Gloaming luôn được xem là một trong những chiếc bàn phím cơ giá rẻ đa dạng với rất nhiều kiểu switch cùng hình dáng, màu sắc, đèn LED.', 'Layout :Fullsize\nKeycaps PBT DoubleShot\nKết nối : USB Type C\nSố phím: 108 Keys\nMàu sắc:Black / White / Orange \nSwitch: Cherry MX\nTần số:1000hz\nMatrix: NKRO\nTương thích:Windows / Mac OS X\nChất liệu:ABS\nKích thước: (L) 442 x (W) 138 x (H) 42 mm\nTrọng lượng:1100g', 'Bàn phím Mistel Sleeker X-VIII Gloaming', 2650000, 3.5139, 5, 14, '2021-07-02 20:50:24'),
(85, 'Keyboard', 'Bàn phím cơ Mistel Sleeker X-VIII Glaze Blue luôn được xem là một trong những chiếc bàn phím cơ giá rẻ đa dạng với rất nhiều kiểu switch cùng hình dáng, màu sắc, đèn LED.', 'Layout :Fullsize\nKeycaps PBT DoubleShot\nKết nối : USB Type C\nSố phím: 108 Keys\nMàu sắc:Black\nSwitch: Cherry MX\nTần số:1000hz\nMatrix: NKRO\nTương thích:Windows / Mac OS X\nChất liệu:ABS\nKích thước: (L) 442 x (W) 138 x (H) 42 mm\nTrọng lượng:1100g', 'Bàn phím Mistel Sleeker X-VIII Glaze Blue', 2900000, 3.10987, 5, 39, '2021-07-02 20:50:24'),
(86, 'Keyboard', 'Bàn phím SK639 - black mang một cái nhìn táo bạo mới cho bàn phím cơ giá rẻ với switch Cherry MX low-profile. Nhưng vẫn giữ nguyên độ bền và độ chính xác của các công tắc Cherry MX truyền thống, giờ đây với khoảng cách di chuyển và điểm truyền động giảm 0,8mm. \nThêm vào các khóa phím đôi siêu phẳng và định dạng tối thiểu 60% và bạn có một bàn phím cơ hiệu suất cao trong một bộ vỏ mà bạn gần như có thể bỏ vừa túi.', 'Loại bàn phím SK630\nKết nối USB\nSwitch Cherry MX Lowprofile\nReport Rate 1000Hz\nThời gian phản hồi 1ms\nBộ nhớ 512KB\nBộ nhớ Chip 32bit ARM Cortex M3\nCụm phím Media Có\nChiều dài dây cáp 1.8m\nKích thước 353.5 x 125.5 x 29.8 mm\nMàu Đen', 'Bàn phím cơ Cooler Master SK630', 3590000, 4.95871, 5, 26, '2021-07-02 20:50:24'),
(87, 'Keyboard', 'G913 là một chiếc bàn phím cơ giá rẻ đặc biệt dành cho những ai tìm kiếm sự khác biệt. Có thể giá của nó không dễ chịu chút nào nhưng những gì nó đem lại thì thật sự xứng đáng.\n\nThiết kế độc đáo\nChiếc bàn phím gaming cực kỳ nổi bật với thiết kế floating switch siêu mỏng không giống với bất kỳ mẫu bàn phím cơ nào trên thị trường hiện nay. Phần mặt trên được làm bằng hợp kim nhôm và hoàn thiện phay xước giúp cho chiếc bàn phím có một diện mạo sang chảnh bắt mắt.\n\nƯu tiên tốc độ\nSwitch GL được sử dụng trên G913 TKL có điểm nhận phím rất ngắn, chỉ có 1,5mm so với 2mm đối với các loại switch cơ của Cherry thông thường. Điều này giúp bạn thao tác nhanh hơn, nhạy hơn và giữ lợi thế lớn hơn. Hành trình phím cũng khá ngắn, chỉ có 2,7mm, bạn sẽ đỡ hao lực hơn khi gõ phím, giúp ít bị mỏi tay khi thao tác trong thời gian dài.', 'THÔNG SỐ KỸ THUẬT THỰC TẾ\nĐộ dài: 368 mm\nChiều rộng: 150 mm\nChiều cao: 22 mm\nTrọng lượng (không tính dây): 810 g\nĐộ dài dây cáp: 1,8 m\nMàu Đen', 'Bàn phím Logitech G913 TKL Lightspeed', 5290000, 4.05666, 5, 23, '2021-07-02 20:50:24'),
(88, 'Keyboard', 'Nói không với vẻ ngoài hầm hố, cồng kềnh, bàn phím chơi game iKBC Typemaster X410 có ngoại hình mỏng manh hơn rất nhiều phần với kê tay liền bàn phím. Phần vỏ được sơn nhám, chống bám vân tay, độ hoàn thiện chắn chắn.', 'THÔNG SỐ KỸ THUẬT THỰC TẾ\n\nPackage Dimensions: 18.27 x 7.8 x 1.85 inches\nItem Weight: 2.89 pounds\nManufacturer: IKBC\nASIN: B082FTSMNP\nItem model number: X410', 'Bàn phím iKBC Typemaster X410', 1990000, 4.25405, 5, 18, '2021-07-02 20:50:24'),
(89, 'Keyboard', 'Với bộ Switch Cherry được thiết kế tỉ mỉ từng chi tiết với 3 lựa chọn Chery switch cơ bản là red, brown và blue switch. \nPhù hợp với hầu hết nhu cầu của người dùng đang cần trên một chiếc bàn phím cơ.Chỉ cần thử một lần, chắc chắn bạn sẽ không thể gõ lại bàn phím thông thường được nữa.', 'THÔNG SỐ KỸ THUẬT THỰC TẾ\n\nMàu: Dragon Ball  – Son GoKu: \nSwitch: Cherry MX: \nKeycap: PBT khắc Laser: \nSố phím: 84 phím: \nKết nối: USB: \nN-Key Rollover: Có', 'Bàn phím AKKO Dragon Ball Super', 2490000, 4.36321, 5, 12, '2021-07-02 20:50:24'),
(90, 'Keyboard', 'Updating...', 'Độ dài: 132 mm\nChiều rộng: 445 mm\nChiều cao: 35,5 mm\nTrọng lượng (không tính dây): 1130 g\nĐộ dài dây cáp: 1,8 m\nLoại kết nối: USB 2.0\nGiao thức USB: USB 2.0\nCổng USB (Tích hợp): Có, 2.0\nĐèn chỉ báo (LED): 2\nChiếu sáng nền: Có, chiếu sáng RGB cho mỗi phím', 'Bàn phím Logitech G512 GX RGB', 1990000, 3.62246, 5, 24, '2021-07-02 20:50:24'),
(91, 'Keyboard', 'Bàn phím cơ Dareu EK1280 RGB được thiết kế và sản xuất bởi hãng Dareu – một công ty chuyên về thiết kế, phát triển và sản xuất các thiết bị ngoại vi như chuột, bàn phím cơ giá rẻ, tai nghe chuyên dùng cho gaming đang được các game thủ Việt Nam ưa chuộng trong thời gian hiện nay', 'Bảo hành : 24 tháng\nHãng sản xuất : DareU\nLED: RGB\nSwitch: D Switch (Blue/Red/Brown)', 'Bàn phím Gaming DareU EK1280 RGB', 880000, 2.72364, 5, 11, '2021-07-02 20:50:24'),
(92, 'Keyboard', 'Mẫu bàn phím cơ giá rẻ AKKO 3108 Midnight với phiên bản màu đen trung tính này mang đến một tone màu thu hút và bí ẩn. Đơn giản nhưng lại bắt mắt!', 'Hãng sản xuất:Akko\nModel: 3108 (Fullsize, 108 keys)\nKết nối: USB Type C, có thể tháo rời\nKích thước: 442 x 140 x 40mm\nHỗ trợ: NKRO\nKeycap: PBT Double-Shot, Cherry profile\nLoại switch: Akko switch (Blue/Orange/Pink)\nTrợ năng: Hỗ trợ multimedia, macro và có thể khóa phím windows\nPhụ kiện: 1 sách hướng dẫn sử dụng, 1 keypuller, 1 cover che bụi, 1 dây cáp USB', 'Bàn phím AKKO 3108 Midnight (Akko sw)', 940000, 4.13447, 5, 54, '2021-07-02 20:50:24'),
(93, 'Keyboard', '', 'Model: Tenkeyless, 87 keys\nKết nối: USB Type C, có thể tháo rời\nHỗ trợ: NKRO\nKeycap: PBT Dye-Subbed\nLoại switch: Akko switch\nKeycap custom: lấy chủ đạo là màu hoa anh đào, núi Phú sĩ, cá chép và mèo may mắn\nLED: không\nHỗ trợ multimedia: macro và có thể khóa phím windows\nPhụ kiện: 1 sách hướng dẫn sử dụng + 1 keypuller + 1 cover che bụi + 1 dây cáp USB', 'Bàn phím Akko World Tour Tokyo 3087', 1290000, 3.3305, 5, 45, '2021-07-02 20:50:24'),
(94, 'Keyboard', '', 'Model: 3068 (Tenkeyless, 68 keys)\nKết nối: USB Type C, có thể tháo rời\nHỗ trợ: NKRO\nKeycap: PBT\nLoại switch: cherry switch\nKeycap custom: Font được in ở mặt nghiêng của nút, lấy chủ đạo là màu xanh - đặc trưng của đại dương\nLED: không\nHỗ trợ multimedia: macro và có thể khóa phím windows\nPhụ kiện: 1 sách hướng dẫn sử dụng + 1 keypuller + 1 cover che bụi + 1 dây cáp USB', 'Bàn phím Akko 3068SP Oceanstar - Cherry switch', 1490000, 3.08702, 5, 15, '2021-07-02 20:50:24'),
(95, 'Keyboard', '', 'Bàn phím cơ IKBC CD87 phiên bản PD\nKeycap PBT Doubleshot (PD) dày dặn chắc chắn\nSử dụng kết nối dây USB\nDùng Switch Cherry nổi tiếng cho cảm giác gõ tốt và độ bền cao\nBuild quality chắc chắn, chất lượng rất tốt trong tầm giá\nLayout chuẩn ANSI quốc tế, dễ làm quen\nMàu sắc và thiết kế đơn giản', 'Bàn phím iKBC CD87 PD', 1550000, 3.78322, 5, 36, '2021-07-02 20:50:24'),
(96, 'Keyboard', 'Gọn đẹp, đơn giản nhưng không hề thua kém về tính năng và quan trọng hơn hết là Corsair K63 sử dụng switch hàng hiệu Cherry MX. Đây được xem là một trong những bàn phím cơ giá rẻ nên mua mà các bạn học sinh - sinh viên không nên bỏ qua', 'Switch: Cherry® MX Red\nĐộ bền: 60 triệu lần nhấn\nHành trình nhấn: 2.0 mm \nLực tác động: 45g\nTốc độ phản hồi: Up to 1ms / 1000Hz\nKích thước: 365mm x 171mm x 41mm\nTrọng lượng: 1.12Kg\nChất liệu dây cáp: Cáp bọc vải\nKiểu bàn phím: Tenkeyless\nĐặc điểm khác: \nĐèn nền: Led đơn sắc màu đỏ\nPhần mềm hỗ trợ: CUE software\nYêu cầu HĐH: Windows 10, Windows 8, Windows 7, or Windows Vista\nPhím chức năng: Dedicated (MUTE, VOL DOWN/UP, STOP, PREV, PLAY/PAUSE, NEXT)\nAnti-ghosting: 100% anti-ghosting with full key rollover', 'Bàn phím Corsair K63', 1890000, 3.00053, 5, 20, '2021-07-02 20:50:24'),
(97, 'Keyboard', '', 'Razer™ Mechanical Switches with 50g actuation force\n80 million keystroke lifespan\nRazer Synapse enabled\n10 key roll-over anti-ghosting\nFully programmable keys with on-the-fly macro recording\nGaming mode option\n1000 Hz Ultrapolling\nInstant Trigger Technology\nDetachable braided fiber cable with cable strap', 'Bàn phím Razer Blackwidow Lite', 2090000, 2.92512, 5, 10, '2021-07-02 20:50:24'),
