(99, 'Keyboard', '', 'Product Number: DKON1808ST\nStructure: Mechanical structure\nTrigger switch: Razer mechanical switches\nConnection interface: USB 2.0\nKeycap material: PBT\nOutput key number: USB N-Key Rollover\nPrinting technology: Double-Shot\nDimensions: 440 x 135 x 40mm\nWeight: 1,100g\nOrigin of production: Taiwan', 'Bàn phím cơ Ducky One 2 RGB Razer Limited Edition', 3490000, 0.957099, 5, 25, '2021-07-02 20:50:24'),
(100, 'Keyboard', 'Bàn phím cơ Corsair K100 RGB sở hữu bộ khung bàn phím bằng chất liệu kim loại, bề mặt được phủ một lớp nhôm phay xước gia công khéo léo và tinh tế ôm vừa khít các chân switch, tạo cảm giác vừa vặn và chắc chắn, bảo vệ tốt cho bàn phím kích cỡ full size 108 phím với các phím điều khiển media và nút cuộn volume quen thuộc góc trên bên phải', 'Thương hiệu: Corsair\nSwitch: Corsair OPX hoặc Cherry MX Speed\nKết nối: USB \nSố lượng phím: 111 phím\nLed: RGB\nAnti Ghosting: Full Key (NKRO) với 100% Anti-Ghosting\nPhần mềm: ICUE\nTrọng lượng: 1.31Kg', 'Bàn phím cơ Corsair K100 RGB', 5390000, 4.49672, 5, 44, '2021-07-02 20:50:24'),
(101, 'Laptop', 'Nhà sản xuất : ASUS\nXuất xứ : Chính hãng\nBảo hành : 24 Tháng\nTình trạng : Mới 100%\nMàu sắc: Bạc', 'CPU: Intel Pentium Silver N5000 (1.10GHz upto 2.70GHz, 4MB)\nRAM: 4GB(1 x 4GB DDR4) 2400MHz (1 Khe cắm, Hỗ trợ tối đa 8GB)\nỔ cứng: 256GB SSD M.2 NVMe + 1slot M2 SATA\nVGA: Intel® UHD Graphics 600', 'Laptop Asus Vivobook X409MA BV033T', 7190000, 3.61187, 5, 39, '2021-07-02 20:50:24'),
(102, 'Laptop', '', 'Hãng sản xuất	HP \nChủng loại	HP 15s-fq1107TU \nPart Number	193Q3PA \nMàu sắc	Bạc \nBộ vi xử lý	Intel® Core™ i3-1005G1(tần số cơ bản 1.2 GHz, upto 3.4Ghz, bộ nhớ đệm 4 MB, 2 lõi) \nChipset	 \n1 USB 3.1 Gen 1 Type-C™ (Data Transfer Only, 5 Gb/s signaling rate); 2 USB 3.1 Gen 1 Type-A (Data Transfer Only); 1 RJ-45; 1 AC smart pin; 1 HDMI 1.4b; 1 headphone/microphone combo \nBộ nhớ trong	4 GB DDR4-2133 SDRAM (1 x 4 GB) \nSố khe cắm	Multi-format card reader (SD/SDHC) \nDung lượng tối đa	None \nVGA	Đồ họa Intel® HD Graphics 620 \nỔ cứng	256 GB PCIe® NVMe™ M.2 SSD \nCard Reader	1 multi-format SD media card reader. \nMàn hình	15,6\" HD \nWebcam	HP TrueVision HD Camera \nAudio	Integrated dual array digital microphone \nGiao tiếp mạng	Được tích hợp 10/100/1000 GbE LAN \nGiao tiếp không dây	Bộ Realtek RTL8821CE 802.11b/g/n/ac (1x1) và Bluetooth® 4.2 \nCổng giao tiếp	1 USB 3.1 Type-C™ Thế hệ 1 (Chỉ để truyền dữ liệu, Tốc độ truyền dữ liệu lên tới 5 Gb/s); 2 USB 3.1 Type-A Thế hệ 1 (Chỉ để truyền dữ liệu); 1 RJ-45; 1 bộ chuyển đổi điện xoay chiều thông minh; 1 HDMI 1.4b; 1 bộ tai nghe/micrô \nPin	3-cell, 41 Wh Li-ion \nKích thước (rộng x dài x cao)	35,85 x 24,2 x 1,99 cm \nCân nặng	1,74 kg \nHệ điều hành	Windows 10 Home', 'Laptop HP 15s FQ1107TU 193Q3PA', 9990000, 1.25569, 5, 35, '2021-07-02 20:50:24'),
