INSERT INTO `products` (`productID`, `type`, `description`, `spec`, `name`, `price`, `rating`, `numRate`, `sold`, `dateCreated`) VALUES
(121, 'Mainboard', 'Main máy tính PRIME A320 series sở hữu Công nghệ 5X Protection II đầu ngành, sử dụng những linh kiện tốt nhất, thiết kế mạch hoàn hảo và tuân thủ các tiêu chuẩn khắt khe để bảo đảm chất lượng và độ bền lâu dài cho bo mạch chủ của bạn.', 'CPU: AMD Socket AM4 cho AMD Ryzen™/A-series thế hệ thứ 7/Athlon™ bộ vi xử lý | Hỗ trợ CPU lên đến 8 lõi\nChipset: AMD A320\nMemory: 2 x DIMM, Max. 32GB, DDR4 3200(O.C.)/2933(O.C.)/2666/2400/2133 MHz ECC và không ECC, Không Đệm Bộ nhớ\nGraphic: Đồ họa AMD Radeon™ R Series tích hợp trong APU A-series thế hệ thứ 7 \nLAN: Realtek® RTL8111H, 1 x Bộ điều khiển Gigabit LAN\nAudio: Realtek® ALC887 8-kênh CODEC Âm thanh HD\nOperating System: Windows® 10 64-bit', 'Mainboard ASUS PRIME A320M E', 1290000, 3.21379, 5, 21, '2021-07-02 20:50:25'),
(122, 'Mainboard', 'Mainboard Asus EX H410M-V3 là một trong những dòng sản phẩm main máy tính với khả năng cung cấp năng lượng được tăng cường và thiết kế làm mát tối ưu hóa cung cấp nhiều diện tích bề mặt hơn để tản nhiệt.', 'CPU: Intel® Socket 1200 for 10 Gen Intel Core, Pentium Gold and Celeron Processors\nChipset: Intel® H410\nMemory: 2 x DIMM, Max. 64GB, DDR4 2933/2800/2666/2400/2133 MHz Non-ECC, Un-buffered Memory\nGraphic: 1 x HDMI 1.4b\nLAN: Realtek® RTL8111H\nAudio: Realtek ALC887 8-Channel High Definition Audio CODEC\nOperating System: Windows® 10 64-bit', 'Mainboard Asus EX H410M-V3', 1490000, 3.96542, 5, 45, '2021-07-02 20:50:25'),
(123, 'Mainboard', 'Main máy tính TUF Gaming được thiết kế và thử nghiệm đặc biệt để tồn tại và phát triển trong điều kiện mà các bảng khác sẽ phải vật lộn. Được thiết kế với các linh kiện có độ bền cao, các bo mạch chủ này mang lại sự ổn định vững chắc cho các phiên trò chơi kéo dài tới chừng nào bạn yêu cầu.', 'CPU: Intel® Socket 1151 for 8th Gen Intel Core, Pentium Gold and Celeron Processors\nChipset: Intel® B360\nMemory: 4 x DIMM, Max. 64GB, DDR4 2666/2400/2133 MHz Non-ECC, Un-buffered Memory\nLAN: Intel® I219V, 1 x Gigabit LAN\nAudio: Realtek ALC887 8-Channel High Definition Audio CODEC\nOperating System: Windows® 10 64-bit', 'Mainboard Asus TUF B360M-Plus Gaming LGA 1151v2', 1990000, 3.3419, 5, 5, '2021-07-02 20:50:25'),
(124, 'Mainboard', 'MAG B365M MORTAR là một trong những chiếc main máy tính giá rẻ mới nhất của MSI trên nền tảng socket 1151-v2. Hỗ trợ các dòng CPU thế hệ thứ 8 và 9 của Intel và được trang bị đầy đủ các tính năng cơ bản, phù hợp với các cấu hình chơi game tầm trung của game thủ.', 'SOCKET: 1151\nCPU (MAX SUPPORT): i9\nCHIPSET: Intel B365 Chipset\nDDR4 MEMORY: 2666/ 2400/ 2133 MHz\nMEMORY CHANNEL: Dual\nDIMM SLOTS: 4\nMAX MEMORY (GB): 64\nPCI-E X16: 1\nPCI-E GEN: Gen3\nPCI-E X1: 2\nSATAIII: 6\nRAID: 0/1/5/10\nTPM (HEADER): 1\nLAN: 1x Intel I219-V\nUSB 3.1 PORTS (FRONT): 2(Gen1, Type A)\nUSB 3.1 PORTS (REAR): 4(Gen1, Type A)\nUSB 2.0 PORTS (FRONT): 4\nUSB 2.0 PORTS (REAR): 2\nSERIAL PORTS(FRONT): 1\nPARALLEL PORT(FRONT): 1\nAUDIO PORTS (REAR): Realtek ALC892 Codec\nHDMI: 1\nDIRECTX: 12\nFORM FACTOR: Micro ATX', 'Mainboard MSI MAG B365M Mortar LGA1151v2', 2150000, 3.99612, 5, 12, '2021-07-02 20:50:25'),
(125, 'Mainboard', 'GIGABYTE B460M AORUS ELITE là dòng bo mạch chủ cao cấp thế hệ mới của Gigabyte. Mainboard này hỗ trợ tốt cho các dòng CPU Intel thế hệ 10. Được trang bị đầy đủ các cổng kết nối phổ biến hiện tại cũng như những công nghệ mới nhất giúp game thủ tận dụng tất cả hiệu năng mạnh mẽ đến từ CPU Intel Core i7 10700.', 'CPU: Support for 10th Generation Intel® Core™ i9 processors/Intel® Core™ i7 processors/Intel® Core™ i5 processors/Intel® Core™ i3 processors/Intel® Pentium® processors/Intel® Celeron® processors in the LGA1200 package\nChipset: Intel® B460 Express Chipset\nMemory: Intel® Core™ i9/i7 processors - Support for DDR4 2933/2666/2400/2133 MHz memory modules\nAudio: Realtek® ALC1200 codec\nLAN: Intel® GbE LAN chip (1000 Mbit/100 Mbit)\nOnboard Graphics: Integrated Graphics Processor-Intel® HD Graphics\nBIOS: 1 x 128 Mbit flash | Use of licensed AMI UEFI BIOS | PnP 1.0a, DMI 2.7, WfM 2.0, SM BIOS 2.7, ACPI 5.0', 'Mainboard Gigabyte B460M AORUS ELITE', 2690000, 4.60603, 5, 24, '2021-07-02 20:50:25'),
