(139, 'Mainboard', '', 'Supports 9th and 8th Gen Intel® Core™ Processors\nDual Channel Non-ECC Unbuffered DDR4, 4 DIMMs\nIntel® Optane™ Memory Ready\n16 Phase IR Digital VRM Solution with PowIRstage\nCutting-edge AORUS All-In-One Monoblock for both CPU and PCH area.\nOnboard Intel CNVI 802.11ac 2x2 Wave 2 Wi-Fi with All new AORUS Antenna\n127dB SNR AMP-UP Audio with High-End ESS SABRE 9018K2M DAC, LME 49720 and OPA1622 OP-AMP, WIMA audio capacitors\nAQUANTIA® 10GbE BASE-T LAN and Intel® Gigabit LAN with cFosSpeed\nIntel® Thunderbolt™ 3 onboard\nExclusive RGB FAN COMMANDER and OC Touch for professional casemodders and overclockers\nUSB TurboCharger for mobile device fast charge support\nRGB FUSION 2.0 with Multi-Zone Addressable LED Light Show design, support Addressable LED & RGB LED strips\nSmart Fan 5 features Multiple Temperature Sensors and Hybrid Fan Headers with FAN STOP\nFront USB 3.1 Gen 2 Type-C™ Header\nTriple Ultra-Fast M.2 with PCIe Gen3 x4 interface with Triple Thermal Guards', 'Mainboard GIGABYTE Z390 AORUS XTREME WATERFORCE LGA1151v2', 20590000, 4.44063, 5, 35, '2021-07-02 20:50:25'),
(140, 'Mainboard', 'Main máy tính Z490 AQUA có phần tương đồng với X570 AQUA khi  vẫn được thiết kế vuông vức, chắc chắn và nổi bật với tông màu trắng tinh khiết cùng dòng chữ AQUA và hình Đinh Ba được cách điệu ( đinh ba thần là vật bất ly thân của vua Atlan – món bảo vật mà Aquaman phải lên đường kiếm tìm nhằm thống nhất Bảy Biển). Tuy nhiên, có khác biệt một chút đó là cách bố trí các họa tiết lẫn bố cục trên vỏ hộp', 'CPU: Supports 10th Gen and future generation Intel Core™ Processors (Socket 1200)\nMemory: Dual Channel Non-ECC Unbuffered DDR4, 4 DIMMs\nChipset: Intel Z490\nBIOS: 128Mb AMI UEFI Legal BIOS with multilingual GUI support, ACPI 6.0 Compliant wake up events, SMBIOS 2.7 Support\nGraphic: Hardware Accelerated Codecs: AVC/H.264, HEVC/H.265 8bit, HEVC/H.265 10bit, VP8, VP9 8bit, VP9 10bit, MPEG 2, MJPEG, VC-1\nAudio: 7.1 CH HD Audio with Content Protection (Realtek ALC1220 Audio Codec)\nLAN: 1 x 10 Gigabit LAN 100/1000/2500/5000/10000 Mb/s (AQUANTIA AQC107), 1 x 2.5 Gigabit LAN 10/100/1000/2500 Mb/s (Dragon RTL8125BG)\nForm Factor: EATX Form Factor: 12.0-in x 10.5-in, 30.5 cm x 26.7 cm, 8 Layer PCB, 2oz Copper PCB\nOS: Microsoft Windows 10 64-bit', 'Mainboard ASROCK Z490 AQUA', 25990000, 2.5355, 5, 38, '2021-07-02 20:50:25'),
