(152, 'Monitor', 'Màn hình chơi game ASUS VG278QR – 27inch, Full HD, 0,5ms*, 165Hz, trang bị công nghệ FreeSync/Adaptive Sync\n\nMàn hình chuyên game 27 inch Full HD với tốc độ làm mới siêu nhanh 165Hz và công nghệ Adaptive-Sync(FreeSync™) để loại bỏ hiện tượng xé hình và gián đoạn tốc độ khung hình\nThời gian đáp ứng 0,5ms* để chơi game mượt và Công nghệ ASUS Extreme Low Motion Blur (ELMB –\nĐộ nhòe chuyển động siêu thấp) để giảm thiểu hơn nữa hiện tượng bóng ma và nhòe ảnh khi chuyển động\nCông nghệ GameFast Input giảm thiểu lag đầu vào và cung cấp khả năng hiển thị chuyển động nhanh hơn từ các thiết bị cuối đến màn hình\nPhím nóng ASUS GamePlus độc quyền tăng cường trải nghiệm chơi còn GameVisual giúp tối ưu hình ảnh\nChứng nhận TUV Rheinland cho công nghệ Khử nhấp nháy và Ánh sáng Xanh dương Thấp, đảm bảo một trải nghiệm xem thoải mái\nĐược thiết kế cho các game cường độ cao, tốc độ, ASUS VG278QR là một màn hình chuyên game 27” Full HD có thời gian đáp ứng siêu nhanh 0,5ms* và tốc độ làm mới cực khủng 165Hz để mang lại cho bạn trải nghiệm chơi game siêu mượt. VG278QR trang bị công nghệ Adaptive-Sync (FreeSync™) để loại bỏ hiện tượng xé hình và gián đoạn tốc độ khung hình.', 'Kích thước panel: Màn hình Wide 27,0\"(68.6cm) 16:9\nĐộ bão hòa màu: 72%(NTSC) \nKiểu Panel : TN\nĐộ phân giải thực: 1920x1080 \nKhu vực Hiển thị (HxV) : 597.6 x 336.15 mm\nPixel : 0.311 mm\nĐộ sáng (tối đa): 400 cd/㎡\nBề mặt Hiển thị Chống lóa\nTỷ lệ Tương phản (Tối đa) : 1000:1\nĐộ tương phản thông minh ASUS (ASCR): 100000000:1 \nGóc nhìn (CR ≧ 10): 170°(H)/160°(V)\nMàu sắc hiển thị: 16.7 triệu màu\nKhông chớp \nThời gian phản hồi : 0.5ms (GTG, Min.), 1ms (GTG, Ave.) \nTần số quét (tối đa) : 165Hz\n\nCông nghệ không để lại dấu trace free: Có\nCác lựa chọn tông màu: 3 chế độ\nCác lựa chọn nhiệt độ màu: 4 chế độ\nGamePlus (chế độ) : Có (Ngắm/Hẹn giờ/Bộ đếm FPS/Màn hình hiển thị dạng lưới)\nHỗ trợ HDCP\nTần suất Ánh sáng Xanh Thấp : Có\nVividPixel : Có\nCông nghệ Smart View: Có\nGameVisual :7 chế độ(Cảnh vật/Đua xe/Rạp/RTS/RPG/FPS/Chế độ sRGB/Chế độ MOBA)\nHỗ trợ công nghệ FreeSync™\nCông nghệ GameFast Input\nExtreme Low Motion Blur\n\nLoa âm thanh nổi: 2W x 2 Stereo RMS\n\nGamePlus\nCần Điều hướng 5 Chiều Trên Màn hình\nGameVisual\n\nTín hiệu vào: HDMI(v1.4), DisplayPort 1.2, DVI-D liên kết kép\nĐầu vào âm thanh PC: phát ra tai nghe\nGiắc cắm tai nghe: 3.5mm Mini-Jack\n\nTần số tín hiệu Digital: DisplayPort：195 ~195 KHz (H) /40 ~165 Hz(V)\nHDMI : 30 ~140 KHz (H) /40 ~120 Hz(V)\nDVI: 30 ~160 KHz (H) /50 ~144 Hz(V)\n\nĐiện năng tiêu thụ < 40W*\nChế độ tiết kiệm điện <0.5W\nChế độ tắt nguồn <0.5W\n\nMàu sắc khung: Màu đen\nGóc nghiêng: +33°~-5°\nXoay : +90°~-90°\nQuay : +90°~-90°\nTinh chỉnh độ cao : 0~130 mm\nChuẩn VESA treo tường: 100x100mm\nThiết kế Viền Siêu Mỏng : Có\n\nKhoá Kensington\n\nKích thước vật lý kèm với kệ(WxHxD) : 619x (376~506)x211 mm\nKích thước vật lý không kèmkệ (WxHxD) : 619x363x50 mm\nKích thước hộp(WxHxD) : 700x458x190 mm\n\nTrọng lượng thực (Ước lượng) : 5.6 kg \nTrọng lượng không tính chân đế : 3.2 kg\nTrọng lượng thô (Ước lượng) : 8.2 kg\n\nCáp DVI liên kết kép (Có thể có)\nCáp âm thanh \nDây nguồn \nSạc nguồn\nCáp DisplayPort (Có thể có)\nSách hướng dẫn \nCáp HDMI (Có thể có)', 'Màn hình ASUS VG278QR 27\'', 7790000, 2.78064, 5, 18, '2021-07-02 20:50:25'),
