without Stand (WxHxD) : 615 x 372 x 51 mm\nBox Dimension (WxHxD) : 735 x 464 x 216 mm\nWeight\nNet Weight (Esti.) : 7.72 kg,\nWithout Stand (Esti.) : 4.96 Kg,\nGross Weight (Esti.) : 10.77 kg\nAccessories\nDVI cable (Optional)\nMini-DisplayPort-to-DisplayPort cable (Optional)\nAudio cable(Optional)\nPower cord\nUSB cable(Optional)\nQuick start guide\nHDMI cable (Optional)\nWarranty Card\nColor pre-calibration report\nWelcome Card\nCompliance and Standards\nEnergy Star®, BSMI, CB, CCC, CE, CEL level , CU, ErP, FCC, ISO-9241-307, J-MOSS, KCC, PSE, RoHS, TUV-Ergo, TUV-GS, UkrSEPRO, UL/cUL, VCCI, WEEE, WHQL (Windows 10, Windows 7), RCM, TUV Flicker-free , KC , eStandby, TUV Low Blue Light, TCO, ICES-3, PC recycle\nNote\n* Adaptive-Sync only can be activated within “48Hz ~ 75Hz” via HDMI, mini DisplayPort and DisplayPort ports\n*To activate Rapid Rendering needs turn off Adaptive-Sync and only be activated at 75Hz. Brightness, Blue Light Filter, ASCR, Trace Free cannot be adjusted when using this function.\n*measuring a screen brightness of 200 nits without audio/ USB/ Card reader connection', 'Màn hình ASUS ProArt PA278QV 27\'', 8990000, 3.95639, 5, 19, '2021-07-02 20:50:25'),
(154, 'Monitor', 'Màn hình DELL U2721DE tối ưu hóa không gian làm việc của bạn với màn hình thời trang có cấu hình bảng mỏng, chân đế nhỏ gọn và khe quản lý cáp có thể ẩn máy cắt cáp khỏi tầm nhìn. Thêm vào đó, 2 cổng hạ lưu USB (một cổng có tính năng sạc điện) được đặt thuận tiện và có sẵn ở cạnh màn hình, giúp bạn kết nối và sạc các thiết bị ngoại vi của mình một cách dễ dàng. \nMàn hình máy tính DELL U2721DE với các tùy chọn kết nối mở rộng như RJ45 và USB-C, màn hình của bạn đóng vai trò như một trung tâm năng suất cung cấp nguồn điện và Ethernet ổn định - tất cả đều có trong một thiết lập gọn gàng.\nNgoài ra việc quản lý màn hình của bạn sẽ thật dễ dàng với tính năng truyền qua địa chỉ MAC, khởi động PXE và đánh thức trên mạng LAN được tích hợp một cách thuận tiện. Với độ phân giải QHD (2560x1440), bạn sẽ nhận được chi tiết gấp 1,77 lần Full HD.', 'Hãng sản xuất	Dell \nModel	U2721DE\nKích thước màn hình	27 inch\nĐộ phân giải	2560X1440\nTỉ lệ	16:9\nTấm nền màn hình	IPS (In-Plane Switching)\nĐộ sáng	350 cd/㎡\nĐộ tương phản	1000:1\nTần số quét	60Hz\nCổng kết nối	1 x DP 1.4 (HDCP 1.4)\n1 x HDMI1.4 (HDCP 1.4)\n1 x USB Type-C (Alternate mode with DisplayPort 1.4, USB 3.1 upstream port, Power Delivery PD up to 65 W)\n1 x DP (Out) with MST (HDCP 1.4 )\n2 x USB 3.0 downstream port\n2 x USB 3.0 with BC1.2 charging capability at 2A (max)\n1 x Analog 2.0 audio line out (3.5mm jack)\n1 x RJ45\nThời gian đáp ứng	8 ms for NORMAL mode\n5 ms for FAST mode\nGóc nhìn	178°(H)/178°(V)\nĐiện năng tiêu thụ	Voltage Required\n100 VAC to 240 VAC / 50 Hz or 60 Hz + 3 Hz / 1.8 A (maximum)\n\nPower Consumption Normal operation\n33.2 W (typical)\n160W (maximum)**\n\nPower Consumption Stand by / Sleep\nLess than 0.3W\nKích thước	612.2 x 355 x 39 mm\nCân nặng	4.19 kg\nPhụ kiện	Cáp nguồn, Cáp DisplayPort, Hướng dẫn sử dụng,...', 'Màn hình Dell UltraSharp U2721DE 27\'', 10690000, 2.73386, 5, 44, '2021-07-02 20:50:25'),
