(157, 'Monitor', 'Hướng đến đối tượng là người dùng sáng tạo làm việc nhiều với hình ảnh, đặc biệt là các editor, chiếc màn hình LG 34WK95C-W mang đến không gian làm việc rộng rãi thoải mái, màu sắc chân thực cùng nhiều tính năng tối ưu cho creator.\n\nTầm nhìn rộng mở\nLG 34WK95C-W mang đến cho bạn một khung nhìn siêu rộng tỉ lệ 21/9 rộng 34 inch cực kỳ tối ưu cho những ai cần không gian rộng rãi thoải mái để quản lý nhiều công việc cùng lúc. Độ phân giải 3440 x 1440 vượt trên cả tiêu chuẩn 2K thông thường giúp bạn cảm nhận được những hình ảnh sắc nét, chân thực nhất. Độ cong nhẹ của tấm nền cũng giúp tạo cho bạn cái nhìn sâu hơn, giảm độ sai lệch màu theo góc nhìn, cho bạn trải nghiệm đã hơn, phê hơn và nịnh mắt hơn. Đối với những phần mềm có timeline để edit âm thanh, video thì tỉ lệ tối ưu chiều ngang của chiếc màn hình này sẽ thực sự tỏa sáng.', '34\" Curved 21:9 UltraWide®\n3440 x 1440 QHD Resolution\nNano IPS Display\nDCI-P3 98% (Typ.) Color Gamut\nVESA DisplayHDR™ 400\nUSB Type-C™ with 60W PD\nPICTURE QUALITY\n\nRefresh Rate: 75Hz\nResolution: 3440 x 1440\nPanel Type: IPS\nAspect Ratio: 21:9\nBrightness: 400 cd/m² (Typ.), 320 cd/m²(Min.)\nColor Gamut: DCI-P3 98% (CIE1976)\nResponse Time: 5ms (GtG at Faster)\nContrast Ratio (DFC): 1000:1 (Typ.), 700:1 (Min)\nViewing Angle: 178/178\nSurface Treatment: Anti glare 3H\nDynamic Action Sync: Yes\nINPUTS/OUTPUTS\nHeadphone Out: Yes\nDisplayPort: Yes (ver. 1.2 HDR Support)\nUSB-C: Yes (ver. 1.2 HDR Support) 60W PD\nUSB Up-Stream (ver 3.0): Yes x1\nUSB Down-Stream (ver 3.0): Yes x2\nHDMI: Yes x 2\nPOWER\nDC Off: less than 0.3W\nType: Adapter\nInput: 100~240V (50/60Hz)\nPower Consumption (Typ.): 85W\nPower Consumption (Max.): 200W\nSPECIAL FEATURES\nSmart Energy Saving: Yes\nPIP/PBP: Yes\nReader Mode: Yes\nFlicker Safe: Yes\nBlack Stabilizer: Yes\nOn Screen Control: Yes\nColor Calibrated: Yes\nColor Weakness: Yes\nAdaptive Sync: Radeon FreeSync™\nWide Color Gamut: Yes\nNano IPS™ Technology: Yes\nHDR Effect: Yes\nVESA DisplayHDR™: Yes\nHDR10: Yes\nCurved: Yes\nDynamic Action Sync: Yes\nDIMENSIONS/WEIGHTS\nShipping Weight: 23.2 lbs\nWith Stand (WxHxD): 32.3\" x 22.1\" x 9.9\" (Up)/32.3\" x 17.8\" x 9.9\" (Down)\nWithout Stand (WxHxD): 32.3\" x 14.3\" x 3.7\"\nShipping Dimensions (WxHxD): 38.9\" x 20.7\" x 8.3\"\nWith Stand Weight: 15.4 lbs\nWithout Stand Weight: 12.4 lbs\nSTAND\nTilt (Angle): Yes\nHeight (mm): Yes (110mm)', 'Màn hình LG 34WK95C-W 34\'', 28500000, 4.24518, 5, 54, '2021-07-02 20:50:25'),
(158, 'Monitor', 'Màn Hình Lớn Với Kích Thước Vượt Trội\nMàn hình máy tính Samsung CJ89 với độ lớn màn hình lên đến 49 inch mang đến tầm nhìn vượt trội. Với màn hình cong cùng tỷ lệ 32:9 tương đương với hai màn hình 27 inch ghép, bạn sẽ có thể tận hưởng trải nghiệm xem tràn viền, đa nhiệm mượt mà và trải nghiệm chơi game giải trí hoàn hảo chưa từng có.\n\nTrải Nghiệm Xem Mượt Mà\nMàn hình máy tính Samsung CJ89 với độ lớn màn hình lên đến 49 inch mang lại tầm nhìn vượt trội. Với màn hình cong cùng tỷ lệ 32:9 tương đương khi làm việc với hai màn hình 27 inch ghép, bạn sẽ có thể tận hưởng trải nghiệm xem tràn viền, đa nhiệm mượt mà và chơi game giải trí hoàn hảo chưa từng có.\n\nMàn Hình Phụ PIP\nLinh hoạt đa nhiệm đồng thời xem nhiều nội dung với độ phân giải tự nhiên, nhờ vào tính năng Picture-in-Picture. Chỉ cần kết nối với một màn hình thứ hai, máy tính xách tay hay thiết bị di động để phân chia màn hình và thực hiện nhiều tác vụ cùng lúc.\n\nTích Hợp Tính Năng KVM Switch\nKVM Switch tích hợp cho phép điều khiển hai thiết bị kết nối với màn hình chỉ bằng bàn phím và chuột, chỉ với nút nhấn một chạm tiện lợi đặt ngay cạnh dưới màn hình.\n\n2 Cổng USB-C\nHai cổng USB-C truyền tải dữ liệu và năng lượng, cho phép bạn sạc các thiết bị trực tiếp từ màn hình. Kết nối bất kỳ máy tính xách tay hay thiết bị di động tương thích đến một trong các cổng USB-C để xem nội dung hiển thị trên màn hình và sạc pin chỉ với duy nhất một sợi cáp.\n*USB-C cổng 1 và cổng 2 hỗ trợ sạc lần lượt lên đến 95W và 15W.', '', 'Màn hình SAMSUNG LC49J890 49\'', 31890000, 3.0634, 5, 32, '2021-07-02 20:50:25'),
(159, 'Monitor', '', 'Number of screens: 1\nScreen size: 68.6 cm (27\')\nScreen mode: 4K UHD\nResponse time: 4ms GTG\nAspect ratio: 16:9\nHorizontal viewing angle: 178\nVertical viewing angle: 178\nMount type: Wall mountable\nBacklight technology: LED\nPanel technology: In-plane Switching (IPS) Technology\nTilt angle: -5 to 25\nSwivel angle: 20\nMaximum adjustable height: 130 mm\nHorizontal frequency: 30 kHz to 140 kHz, 52kHz to 322 kHz\nVertical frequency: 24 Hz to 144 Hz, 24 Hz to 60 Hz\n\nVIDEO\nMaximum resolution: 3840 x 2160\nStandard refresh rate: 144 Hz\nColour support: 16.7 Million Colours\nBrightness: 600 cd/m2\nNative contrast ratio: 1000:1\nTearing prevention technology: NVIDIA G-SYNC\nColour depth: 10-bit\n\nAUDIO\nNumber of speakers: 2\nSpeakers: Yes\nSpeaker output power: 4 W\n\nINTERFACES/PORTS\nHDMI: Yes\nUSB: Yes\nDisplay port: Yes\n\nPOWER DESCRIPTION\nEnergy efficiency class: D\nEnergy Consumption per year: 103 kWh\nOperating power consumption (EEL): 71 W\n\nPHYSICAL CHARACTERISTICS\nVESA mount compatible: Yes\nColour: Black\nHeight: 86.5 mm\nWidth: 629 mm\nDepth: 374.7 mm\nHeight with stand: 575 mm\nWidth with stand: 629 mm\nDepth with stand: 374.7 mm\nWeight(approximate): 4.77 kg', 'Màn hình Acer PREDATOR X27 27\'', 67990000, 3.0213, 5, 11, '2021-07-02 20:50:25'),
(160, 'Monitor', '', 'Display\n\nPanel Size: Wide Screen 64.5“ (163.9cm) 16:9\nColor Saturation : 95% DCI-P3\nPanel Type : VA\nTrue Resolution : 3840x2160\nDisplay Viewing Area(HxV) : 1428.48 x 803.52 mm\nDisplay Surface : Non-glare\nPixel Pitch : 372 mm\nBrightness : 1000 cd/㎡ (Peak)\nContrast Ratio : 4000 :1 (Typical)\nViewing Angle (CR≧10) : 178°(H)/178°(V)\nResponse Time : 4ms (Gray to Gray)\nDisplay Colors : 16.7M\nFlicker free : Yes\nHDR (High Dynamic Range) Support : Yes (HDR-10 )\nDynamically Local Dimming : Yes, 384 Zones\nRefresh Rate(max) : 144Hz\nVideo Feature\n\nColor Accuracy : △E< 2\nGamma adjustment : Yes (Support Gamma 1.8/2.0/2.2/2.4/2.6 )\nGamePlus(modes) : Yes (Crosshair/Timer/FPS Counter)\nLow Blue Light : Yes\nHDCP support : Yes\nGameVisual :6 Modes(Scenery/Racing/Cinema/RTS/RPG/FPS/sRGB Modes)\nG-Sync Ultimate\nAudio Features\n\nStereo Speakers : 15Wx2 Stereo RMS\nAudioWizard Preset Sound modes : 2 Modes (Yes Gaming mode / Movie mode /)\nI/O Ports\n\nSignal Input : HDMI(v2.0) x4, DisplayPort 1.4\nAudio Output : SPDIF\nUSB Port(s) : 3.0x2\nSignal Frequency\n\nDigital Signal Frequency : DisplayPort：255 ~255 KHz (H) /1 ~144 Hz(V)\nHDMI : 30 ~135 KHz (H) /24 ~60 Hz(V)\nPower Consumption\n\nPower Consumption: <700W\nVoltage: 100–240V, 50 / 60 Hz\nMechanical Design\n\nVESA Wall Mounting : 400x400mm\nDimensions\n\n1448.08 mm x 946.9 mm x 389.82 mm (with stand)\n1448.08 mm x 863.83 mm x 87.2 mm (without stand)\n1630 mm x 1104 mm x 507 mm (package)\nWeight\n\n36.8 kg (net), 57.5 kg (gross)\nAccessories\n\nHexagon key\nCable management hook\nPower cord\nDisplayPort cable\nUSB cable\nQuick start guide\nHDMI cable\nWarranty Card\nColor pre-calibration report\nRemote Controller\nAura Sync ROG Logo projector\nCompliance and Standards\n\nTUV Flicker-free , TUV Low Blue Light, UHDA, VESA DisplayHDR 1000', 'Màn hình Asus ROG Swift PG65UQ 65\'', 170000000, 4.93881, 5, 100, '2021-07-02 20:50:25'),
(161, 'Mouse', 'Updating...', 'Thương hiệu: Acer\nLED: RGB\nDPI: 4200\nPointing Device Features: Ergonomic\nSwitch Life (Clicks): 10 Million\nNumber of Total Buttons: 6\nNumber of Programmable Buttons: 0\nColour: Black\n', 'Chuột Acer Predator Cestus 310', 1750000, 3.96863, 5, 34, '2021-07-02 20:50:25'),
(162, 'Mouse', 'Gladius II Core là một phần trong của hệ sinh thái ROG của Asus. Đây là một mẫu chuột gaming đa năng, dễ cầm, dễ làm quen, phù hợp với nhiều kiểm cầm và nhiều dòng game khác nhau. Đặc biệt, nếu bạn đã là fan Asus mà lại còn thích LED RGB thì chắc chắn mẫu chuột này sẽ cực kỳ đáng mua', 'Hãng sản xuất: Asus\nTên sản phẩm: Chuột có dây Asus ROG Gladius II Core\nKiểu dáng: Thiết kế công thái học huyền thoại\nKết nối: Có dây\nChuẩn kết nối: USB\nĐèn Led: LED RGB 16.8 Triệu màu, đồng bộ Aura Sync\nPhụ kiện: N/A\nMàu sắc: Black\nTính năng khác: ROG Gladius II Core Cảm biến Pixart PMW3327 DPI tối đa 6200', 'Chuột Asus Rog Gladius II Core', 1090000, 4.58253, 5, 43, '2021-07-02 20:50:25'),
(163, 'Mouse', 'Ironclaw là mẫu chuột chơi game hoàn toàn mới đến từ Corsair, ra mắt vào đầu năm 2019. Đây là mẫu chuột được thiết kế công thái học hoàn hảo cho người thuận tay phải và kiểu cầm palm-grip\nSử dụng nút chuột đến từ Omron, cho độ bền lên đến 50 triệu lượt nhấn.\nMắt đọc được sử dụng là mắt đọc tối tân nhất của Pixart hiện nay: PMW3391. Cho dải tốc độ chuột trải dài từ 1 đến 18000 DPI cùng với độ chính xác hoàn hảo.\n', 'Khối lượng: 105 Gram\nSố Nút: 7\nMắt đọc: Pixart 3391\nĐộ phân giải tối đa: 18000 DPI\nTốc độ theo dõi tối đa: 400 IPS\nGia tốc tối đa: 50 G\nTốc độ phản hồi: 1 ms\nKiểu cầm khuyến nghị: Palm-Grip', 'Chuột Corsair Ironclaw RGB', 1590000, 4.51979, 5, 33, '2021-07-02 20:50:25'),
(164, 'Mouse', 'Updating...', 'Loại chuột: Game MOBA\nTrọng lượng: 122g\nSố Nút có thể lập trình: 17\nMắt đọc: PMW3391\nĐộ phân giải tối đa: 18000 DPI\nTốc độ theo dõi tối đa: 400 IPS\nLED: RGB\nSwitch: Omron\nTốc độ phản hồi: 1 ms\nKiểu chuột: Thuận tay phải', 'Chuột Corsair Scimitar RGB Elite', 2090000, 4.70905, 5, 45, '2021-07-02 20:50:25'),
(165, 'Mouse', 'Chuột Logitech G403 gia nhập cuộc chơi với cảm biến 16K HERO thế hệ mới. Cảm biến tiên tiến nhất của Logitech từ trước tới nay, với khả năng theo dõi 1:1, 400+ IPS và độ nhạy DPI tối đa 100-16,000 — cùng tính năng làm mượt, lọc và tăng tốc.', 'Height: 124 mm\nWidth: 68 mm\nDepth: 43 mm\nWeight: 87.3 g mouse only\nOptional extra weight: 10 g\nCable Length: 2.1 m\nSensor: HERO 16K\nResolution: 100 – 16,000 DPI\nMax. acceleration: tested at over 40 G\nMax. speed: tested at over 400 IPS', 'Chuột Logitech G403 Hero', 1190000, 4.32012, 5, 43, '2021-07-02 20:50:25'),
(166, 'Mouse', 'Chuột logitech G703 gia nhập cuộc chơi với cảm biến 16K HERO thế hệ mới. Cảm biến tiên tiến nhất của Logitech từ trước tới nay, với khả năng theo dõi 1:1, 400+ IPS và độ nhạy DPI tối đa 100-16,000 — cùng tính năng làm mượt, lọc và tăng tốc.', 'Sử dụng cảm biến: HERO\nĐộ phân giải: 200 – 16.000 dpi\nTăng tốc tối đa: >40G*\nTốc độ tối đa: >400 IPS*\nĐịnh dạng dữ liệu USB: 16 bit/trục\nTốc độ báo cáo USB: 1000 Hz (1ms)\nTốc độ báo cáo không dây: 1000Hz (1ms)\nCông nghệ không dây: 2.4GHz tùy chỉnh\nBộ vi xử lý: ARM 32-bit', 'Chuột Logitech G703 Hero Lightspeed Wireless', 2090000, 3.05812, 5, 44, '2021-07-02 20:50:25'),
(167, 'Mouse', 'Với hơn 10 triệu chiếc chuột Razer DeathAdder đã được bán, đây là chiếc chuột chơi game cực nổi tiếng và đã được trao giải nhất trên thế giới trong nhiều năm qua. Nổi tiếng nhờ thiết kế công thái học đặc biệt. Hoàn toàn phù hợp cho form palm, và hỗ trợ tốt với form cầm claw hoặc finger tip. Chính vì thế, Razer DeathAdder V2 tiếp tục di sản này, giữ lại hình dạng đặc trưng của nó trong khi giảm thêm trọng lượng để xử lý nhanh hơn và cải thiện lối chơi của bạn. Vượt lên cả thiết kế công thái học thông thường để trở thành một thiết kế tối ưu hóa mang đến sự thoải mái hơn khi chơi game!', 'Mắt cảm biến: Razer Focus+\nDPI: 20.000 DPI\nLoại Switch: Switch Razer quang học\nTuổi thọ Switch: 70 triệu lượt nhấn\nSố nút lập trình: 8 nút\nDây cáp: Razer™ Speedflex ( 2.1 m )\nTrọng lượng: 82 g\nFeet chuột: 100% PTFE\nCấu hình bộ nhớ; 5 bộ nhớ tích trữ\nCuộn chuột: Linh hoạt\nKích thước: 127  x 61 x 42.7 ( mm ) ( Dài x Rộng x Cao )\nĐèn LED hiển thị: Razer Chroma 16.7 triệu màu RGB\nThiết kế: Công thái học\nTương thích phần mềm: Razer Synapse 3', 'Chuột Razer Deathadder V2', 1690000, 3.15212, 5, 39, '2021-07-02 20:50:25'),
(168, 'Mouse', 'Để việc truyền tải tín hiệu một cách nhanh nhất đến với người dùng khi sử dụng các linh kiện gaming gear không dây, Razer đã áp dụng công nghệ AFT vào Razer Mamba Wireless, giúp hạ thấp độ trễ tín hiệu ngang bằng các loại chuột gaming không dây tốt nhất hiện nay.\nKhác với các phiên bản Razer Mamba trước đây, Razer đã trang bị cho chuột cảm biến Quang học Razer 5G (Pixart 3389) tùy biến từ cảm biến Pixart 3360 tốt nhất thế giới, với độ ổn định tuyệt vời và chính xác nhất. ', 'Razer 5G Advanced Optical Sensor with true 16,000DPI\nUp to 450 inches per second (IPS) / 50 G acceleration\n1000Hz Ultrapolling\n7 independently programmable Hyperesponse buttons\nRazer™ Mechanical Mouse Switches with 50 million clicks life cycle\nDây cáp: Razer™ Speedflex ( 2.1 m )\nGamning-grade tactile scroll wheel\nErgonomic right-handed design\nRazer Chroma™ lighting with 16.8 million customizable color options\nHybrid On-Board Memory and Cloud Storage\nRazer Synapse 3 enabled\nApproximate size: 125.7 mm / 4.95 in (Length) X 70.0 mm / 2.75 in (Width) X 43.2 mm /1.70 in (Height)\nApproximate weight (excluding cable): 106g / 0.213 lbs\nCable lenght: 2.1m / 6.80 ft', 'Chuột Razer Mamba Wireless', 2390000, 2.69125, 5, 56, '2021-07-02 20:50:25'),
(169, 'Mouse', 'Updating...', 'Cảm biến: SteelSeries TrueMove Core ( Quang học )\nCPI: 100 – 8500\nIPS: 300 ( trên bề mặt SteelSeries QcK )\nGia tốc: 35G\nPolling Rate: 1000Hz 1ms\nThiết kế: Công thái học tay phải\nMàu: Đen nhám\nChất liệu: Nhựa ABS\nForm cầm; Fingertip , Claw\nĐèn LED hiển thị: 3 vùng sáng RGB \nTrọng lượng: 77g\nKích thước: 120 x 58 x 21 ( mm ) ( Dài x Rộng x Cao )\nChiều dài dây cáp: 1.8m', 'Chuột Steelseries Rival 3', 890000, 2.64949, 5, 18, '2021-07-02 20:50:25'),
(170, 'Mouse', 'Updating...', 'DPI: 400 / 800 / 1600 / 3200\nUSB: USB 2.0 / 3.0 Plug & Play\nNút bấm: 5 nút\nChiều dài dây cáp chuột: 2m / 6,6 ft\nReport Rate (Tần suất gửi tín hiệu): 125 / 500 / 1000 Hz\nKích thước: M (Cỡ vừa)\nThiết kế: Công thái học', 'Chuột Zowie BenQ EC2 V2', 1690000, 3.57482, 5, 19, '2021-07-02 20:50:25'),
(171, 'Mouse', 'Chuột Fuhlen F200 chuyên dành cho các game thủ thuận tay phải, đảm bảo tính thoải mái tối đa cho người dùng. Sản phẩm được thiết kế bằng chất liệu nhựa nhám không bị bám vân tay, đảm bảo độ sạch sẽ, chắc chắn và hạn chế trượt tay khi sử dụng.', 'Model: F200\nThiết kế Egonomic, vừa tay, phù hợp cho người dùng Game\nTích hợp 6 phím, đèn led 7 màu có thể điều chỉnh\nVỏ ngoài được tráng bạc, với công nghệ khắc laser tạo ra hiệu ứng đèn led ma trận đẹp mắt\nCảm biến quang học cho độ chính xác cao khi chơi game\nDPI: 1200/1600/2400/3200 DPI\nChơi game chuyên nghiệp, thiết lập nhiều chế độ\nHuano switch 10 triệu lần nhấn\nĐệm feet Teflon lớn và rất dày, không lo bị mòn sau thời gian dài sử dụng\nKiểu giao tiếp: USB, dây dù chống đứt.', 'Chuột Fuhlen F200', 299000, 2.50232, 5, 43, '2021-07-02 20:50:25'),
(172, 'Mouse', 'Updating...', 'Sensor: PAW3512\nSóng 2.4G\nDPI: 800-1200-1600\nSwitch: Silent (3 triệu lần click)\nKích thước: 107.5*59.15*38.29mm\nPin: 01* AA\nTrọng lượng: 90g +/- 10g', 'Chuột Dare-U LM115G Wireless', 200000, 3.26233, 5, 31, '2021-07-02 20:50:25'),
(173, 'Mouse', 'Sporting a comfortable contoured shape with rubber side grips and weighting in at an incredibly light 85g, the Harpoon RGB PRO is ready for endless hours of effortless gaming', 'Prog Buttons: 6\nDPI: 12000\nSensor: PMW3327\nSensor type: Optical\nMouse Button Durability: 20M L/R Click\nGrip type: Claw\nWeight: 85g (w/out cable)', 'Chuột gaming Corsair Harpoon Pro RGB', 430000, 2.59487, 5, 18, '2021-07-02 20:50:25'),
(174, 'Mouse', 'Updating...', 'Thiết kế công thái học kiểu dáng đối xứng cho mọi game thủ\nBộ cảm biến quang học HD và tốc độ tracking IPS 220 inch/s\nChuyển đổi DPI với 7 mức từ 200 – 6,200 đáp ứng thao tác thể loại Game\nBộ nhớ tích hợp bên trong lưu cấu hình phím macro, DPI và chế độ hiệu ứng ánh sáng', 'Chuột Rapoo VT200', 590000, 4.02282, 5, 48, '2021-07-02 20:50:25'),
(175, 'Mouse', 'Asus TUF Gaming M3 là một con chuột chơi game nhỏ gọn mang đến sự thoải mái, hiệu suất và độ tin cậy mà các game thủ yêu cầu. Chuột tiện dụng và nhẹ cho các trò chơi kéo dài, với cảm biến quang có độ chính xác cao mang lại cho bạn lợi thế trong trận chiến. Được hỗ trợ bởi các công tắc 20 triệu lần nhấp và lớp phủ chuyên dụng cho độ bền đặc biệt. Nó cũng có tính năng chiếu sáng Aura Sync RGB tùy biến để bạn có thể tùy chỉnh trong phong cách cá nhân hóa.', 'Thiết kế cân xứng Ergonomic cho cảm giác cầm nắm thoải mái \nTốc độ chuột lên đến 7000 DPI kèm theo 2 nút DPI tinh chỉnh dễ dàng khi đang sử dụng \nLED RGB tích hợp có thể điều chỉnh cùng với các tính năng qua phần mềm AMOURY II', 'Chuột Asus TUF M3', 690000, 4.80315, 5, 44, '2021-07-02 20:50:25'),
(176, 'Mouse', 'Minos XT is a nimble and powerful gaming mouse, ideal for those who enjoy a agile gaming experience', 'ADNS-3050: 4000 DPI\n20 million Omron life cycle clicks\n3-zone RGB\nDynamic RGB lighting effect\nUIX Software support', 'Chuột Cougar Minos XT', 450000, 3.51085, 5, 58, '2021-07-02 20:50:25'),
(177, 'Mouse', 'Để đáp ứng nhu cầu ngày càng cao của mọi game thủ, Razer đã nghiên cứu và áp dụng thành công công nghệ không dây Razer HyperSpeed.\nVới tốc độ cao và độ ổn định cao hơn 25% so với tất cả các dòng chuột gaming không dây khác. Điều này đồng nghĩa mọi thao tác của bạn cùng chuột Razer Basilisk X HyperSpeed sẽ nhanh hơn đối thủ tới 25%, giúp bạn chiếm ưu thế lớn hơn.', 'Công nghệ không dây: Razer Hyperspeed độc quyền\nCảm biến: Razer Focus+\nSố nút có thể tùy chỉnh: 11 nút\nLoại switch: Razer Switch ( 70 triệu lần nhấn )\nIPS: 650\nGia tốc: 50G\nKết nối: Có dây / Không dây Hyperspeed\nThiết kế: Công thái học ( tay phải )\nDPI: 20000\nTương thích: Razer Synapse 3\nThời lượng sử dụng pin: 100giờ \nKích thước: 130 x 60 x 42 ( mm ) ( Dài x Rộng x Cao )\nTrọng lượng: 107\nCấu hình bộ nhớ: 5 bộ nhớ\nFeet chuột: 100% PTFE\nTương thích: Đế sạc chân chuột cho Razer', 'Chuột Razer Basilisk Ultimate', 4490000, 3.43772, 5, 45, '2021-07-02 20:50:25'),
(178, 'Mouse', 'Chuột chơi game ZOWIE Esports cho phép người dùng điều chỉnh DPI và độ phản hồi để phù hợp với cách chơi hoặc sở thích của riêng bạn. Công tắc điều chỉnh được đặt bên dưới chuột, chống nhấn nhầm trong khi chơi.\nNgắn hơn chiều dài tổng thể cho phép người dùng dễ dàng cầm nắm và giữ chuột. Vì vậy người dùng có thể di chuyển tự do trong khi vẫn có thể đặt lòng bàn tay lên lưng chuột thoải mái. Mặt trước nâng lên cung cấp cho người dùng nhiều không gian hơn để đặt ngón tay thứ 4, thoải mái hơn và ít phải duỗi trong việc di chuột. Các mặt bên có hình dạng tương tự như dòng ZA và FK Series.', 'Dòng: S Series\nLoại: S1\nDPI: 400 / 800 / 1600 / 3200\nKết nối USB: USB 2.0 / 3.0 Plug & Play\nNút bấm: 5\nChiều dài dây cáp: 2m\nReport Rate: 125 / 500 / 1000 Hz\nMàu: Xanh\nPhù hợp phong cách tay cầm: Palm / Claw\nKích thước: 126 x 66 x 39 (mm) ( Dài x Rộng x Cao )\nTrọng lượng: 87 g', 'Chuột Zowie S1 Divina Blue', 1950000, 4.2122, 5, 26, '2021-07-02 20:50:25'),
(179, 'Mouse', 'Updating...', 'Durable Silicone Side Grips\n60-Million Click Mechanical Switches\nSize: 131 x 66 x 40 (mm) ( L x W x H )\n', 'Chuột Steelseries Rival 600', 1990000, 2.79912, 5, 43, '2021-07-02 20:50:25'),
(180, 'Mouse', 'Được thiết kế độc quyền bởi SteelSeries và PixArt để vượt trội hơn bất kỳ con chuột nào trên bất kỳ loại bàn di chuột nào, với khả năng này, độ chính xác cao hơn và hoàn hảo hơn bao giờ hết.', 'Cảm biến: TrueMove Pro\nLoại cảm biến: Quang học\nCPI: 50 – 18000 \nIPS: 450\nGia tốc: 50G\nPolling Rate: 1000Hz 1ms\nChất liệu lõi: Nhựa ABS\nThiết kế: Phù hợp cho cả 2 tay\nDáng cầm: Palm, Fingertip, Claw\nSố nút: 8\nTuổi thọ Switch: 60 triệu lần nhấn\nĐèn LED hiển thị: RGB\nKích thước: 126 x 63 x 21 ( mm ) ( Dài x Rộng x Cao )\nTrọng lượng: 92g\nChiều dài dây cáp: 2m', 'Chuột SteelSeries Sensei Ten', 1550000, 4.25246, 5, 31, '2021-07-02 20:50:25'),
