(201, 'RAM', 'Các sản phẩm bộ nhớ RAM PC của Kingston được nghiên cứu, thiết kế và kiểm nghiệm riêng cho PC, nhằm đảm bảo khả năng tương thích, tính ổn định cũng như hiệu năng tối ưu nhất tới người sử dụng PC. Tất cả các dòng sản phẩm bộ nhớ RAM của Kingston trước khi đến tới tay người dùng đều phải được trải qua công đoạn kiểm nghiệm nghiêm ngặt từ nhà máy sản xuất nhằm hạn chế gần như tuyệt đối các sự cố có thể xảy ra trong khi hoạt động.', 'Hãng sản xuất: Kingston\nModel: KVR26N19S6/4\nLoại RAM: DDR4\nDung lượng: 4GB\nBus: 2666MHz\nĐộ trễ: CL19\nĐiện áp: 1.2V\nCông nghệ RAM: Non-ECC\nCL(IDD): 19 cycles\nRow Cycle Time (tRCmin): 45.75ns(min.)\nRefresh to Active: Refresh\nCommand Time (tRFCmin): 350ns(min.)\nRow Active Time (tRASmin): 32ns(min.)\nMaximum Operating Power:TBD W*\nUL Rating: 94 V - 0\nOperating Temperature: 0ºC to +85ºC\nStorage Temperature: -55ºC to +100ºC', 'RAM Kingston CL19 - KVR26N19S6 (4GB DDR4 1x4G 2666)', 490000, 3.30735, 5, 20, '2021-07-02 20:50:25'),
