(204, 'RAM', 'Bộ nhớ DDR4 XPG SPECTRIX D60G có thiết kế dải ánh sáng RGB kép độc đáo mang lại cho nó diện tích bề mặt RGB lớn nhất trong mọi mô-đun bộ nhớ! Hơn nữa, nó có dải tần số rộng từ 3000-4133 MHz và hỗ trợ cấu hình Intel® XMP 2.0 để dễ dàng ép xung', 'Memory Type: Desktop DDR4\nChannel Type: Single Channel\nForm Factor: DIMM (Desktop)\nCapacity: 8GB\nFrequency Speed: 3200MHz\nTiming: 16-20-20\nCAS Latency: CL16\nVoltage: 1.35V\nOS Compatibility: Windows 10 and older', 'RAM ADATA SPECTRIX XPG D60G Gaming RGB (8G DDR4 1x8G 3000)', 1190000, 2.78057, 5, 26, '2021-07-02 20:50:25'),
