(222, 'SSD', '', 'Capacity: 120GB\nPhison S11 Series Controller\nDRAM Cache: 32MB SDR\nStatic and Dynamic Wear Leveling\nBad Block Management\nLow Power Management\nTrim Support\nSmart ZIP\nMTBF: 2,000,000 hours', 'SSD Patriot Burst 2,5 Sata III 120Gb', 490000, 2.89627, 5, 17, '2021-07-02 20:50:25'),
(223, 'SSD', 'Dung lượng lưu trữ của SSD Verico Phantom 240GB – SATA 3 luôn là một điểm quan trọng. PlexCompressor của Plextor sử dụng công nghệ nén thông minh tùy chỉnh, cung cấp cho người dùng nhiều dung lượng lưu trữ hơn mà không ảnh hưởng đến trải nghiệm người dùng và hiệu suất hệ thống', 'Tốc độ đọc 550 MB/s giúp cho việc truy xuất dữ liệu  nhanh chóng\nĐược tích hợp công nghệ SLC Cache nhằm tăng tốc tất cả dữ liệu đầu vào nâng cao hiệu quả công việc.\nĐược trang bị bộ điều khiển 3D NAND tiên tiến đem đến độ bền và hiệu suất làm việc cao, mượt mà\nTập lệnh TRIM, ECC cùng với khả năng RAID và S.M.A.R.T hệ thống mang lại độ tin cậy và an toàn đảm bảo hiệu suất truyền tải dữ liệu', 'SSD Verico Phantom 240GB – SATA 3', 690000, 2.84955, 5, 14, '2021-07-02 20:50:25'),
(224, 'SSD', '', 'Form factor: 2.5 & M2 2280\nInterface: SATA Rev 3.0(6GB/s)\nNAND: TLC\nBaseline performance read: 500MB/s\nBaseline performance write: 350MB/s\nPower consumption: 0.195W idle / 0.279W avg / 0.642W (Max) read / 1.535 (Max) write\nVibration operating: 2.17G peak (7-800Hz)\nLife expectancy: 1M hours MTBF\n', 'SSD KINGSTON A400 240GB M2 Sata 3', 890000, 3.44331, 5, 57, '2021-07-02 20:50:25'),
(225, 'SSD', '', 'Capacity: 240GB\nPart Number: SSD7CS900-240-RB\nForm Factor: 2.5 inch\nInterface: SATA-III 6GB/s; backwards compatible with SATA-II 3GB/s\nMax Sequential Read Speed: 535MB/s\nMax Sequential Write Speed: 500MB/s\nNAND Type: 3D TLC', 'SSD PNY CS900 240G 2,5 Sata 3', 890000, 4.6424, 5, 42, '2021-07-02 20:50:25'),
(226, 'SSD', 'Dung lượng lưu trữ của SSD Verico Phantom 480GB – SATA 3 luôn là một điểm quan trọng. PlexCompressor của Plextor sử dụng công nghệ nén thông minh tùy chỉnh, cung cấp cho người dùng nhiều dung lượng lưu trữ hơn mà không ảnh hưởng đến trải nghiệm người dùng và hiệu suất hệ thống', 'Tốc độ đọc 550 MB/s giúp cho việc truy xuất dữ liệu  nhanh chóng\nĐược tích hợp công nghệ SLC Cache nhằm tăng tốc tất cả dữ liệu đầu vào nâng cao hiệu quả công việc.\nĐược trang bị bộ điều khiển 3D NAND tiên tiến đem đến độ bền và hiệu suất làm việc cao, mượt mà\nTập lệnh TRIM, ECC cùng với khả năng RAID và S.M.A.R.T hệ thống mang lại độ tin cậy và an toàn đảm bảo hiệu suất truyền tải dữ liệu', 'SSD Verico Phantom 480GB – SATA 3', 1250000, 3.16875, 5, 30, '2021-07-02 20:50:25'),
(227, 'SSD', '', 'Nhà sản xuất: GIGABYTE\n Model: GP-GSM2NE8256GNTD\n Chuẩn giao tiếp: PCI-Express 3.0 x2, NVMe 1.3\n Dung lượng: 256GB\n Tốc độ đọc: Up to 1200 MB/s\n Tốc độ ghi: Up to 800 MB/s\nBảo hành: 3 năm', 'SSD GIGABYTE M2 PCIe 256GB', 1290000, 3.83925, 5, 9, '2021-07-02 20:50:25'),
(228, 'SSD', 'Với tốc độ đọc/ghi ổn định lên tới 3500/3000MB mỗi giây, ánh sáng RGB có thể tùy chỉnh và một loạt các tính năng nâng cao hiệu suất, chiếc XPG SPECTRIX S40G là sản phẩm không thể tốt hơn dành cho những người tìm kiếm hiệu suất tuyệt vời và độ tin cậy xuất sắc.', 'Dung lượng: 256GB\nHệ số dạng: M.2 2280\nBộ nhớ NAND Flash: 3D TLC\nKích cỡ (D x R x C): 22 x 80 x 8 mm\nTrọng lượng: 13.4g / 0.47oz\nGiao diện: PCIe Gen3x4\nHiệu suất (tối đa): đọc 3500MB/giây, ghi 3000MB/giây\nTối đa 4K đọc/ghi IOPS ngẫu nhiên : 300K/240K IOPS\n* Hiệu suất có thể thay đổi tuỳ thuộc vào dung lượng ổ cứng SSD, phần cứng và phần mềm chủ, hệ điều hành và các loại hệ thống khác\nNhiệt độ vận hành: 0°C - 70°C\nNhiệt độ bảo quản: -40°C - 85°C\nChống va đập: 1500G/0,5mili-giây\nMTBF: 2.000.000 giờ\nBảo hành: Bảo hành hữu hạn 5 năm', 'SSD ADATA XPG SPECTRIX S40G RGB 256GB', 1490000, 4.81071, 5, 37, '2021-07-02 20:50:25'),
(229, 'SSD', '', 'Nhà sản xuất: Samsung\nChuẩn giao tiếp: PCIe Gen3 x4 NVMe\nKích thước: M.2 2280\nDung lượng: 250 GB\nRandom 4k: 550.000 IOPS\nTốc độ đọc: 3500 MB/s\nTốc độ ghi: 2300 MB/s\nNAND Flash: Samsung V-NAND TLC 96-Layers\nTBW: 150 TB', 'SSD Samsung 970 Evo Plus 250GB M2 NVMe', 1890000, 4.6025, 5, 16, '2021-07-02 20:50:25'),
(230, 'SSD', 'A2000 là chiếc M.2 SSD cao cấp của thương hiệu Kingston. Sử dụng kết nối PCIe 3.0 x4 có băng thông lên tới 32Gb/s. Giúp Kingston KC2000 có tốc độ hoạt động khá tốt, đạt tối đa 2200MB/s đối với tốc độ đọc và 1900MB/s ở tốc độ ghi. Chắc chắn chiếc ổ cứng M.2 SSD này sẽ làm hài lòng rất nhiều người sử dụng.', 'Thương hiệu: KINGSTON\nBảo hành: 60 tháng\nDung lượng: 500GB\nKích thước: M.2 2280\nKết nối: M.2 NVMe\nBộ nhớ NAND: 3D-NAND\nTốc độ đọc: 2000MB/s\nTốc độ ghi: 1100MB/s\nHỗ trợ hệ điều hành: Windows 10, macOS', 'SSD KINGSTON A2000 500GB M2 NVMe', 2190000, 4.75709, 5, 56, '2021-07-02 20:50:25'),
(231, 'SSD', 'SSD Samsung 980 Pro 250GB là dòng ổ cứng đầu tiên hỗ trợ chuẩn kết nối PCIe 4.0 thế hệ mới, thứ mà trước đây chỉ được họ sản xuất phục vụ cho đối tượng người dùng doanh nghiệp cao cấp.', 'Nhà sản xuất: Samsung\nModel: MZ-V8P250BW\nChuẩn giao tiếp: PCIe Gen4.0 x4, NVMe1.3c\nKích thước: M.2 2280\nDung lượng: 250 GB\nRandom 4k: 600.000 IOPS\nTốc độ đọc: 6400 MB/s\nTốc độ ghi: 2700 MB/s\nNAND Flash: Samsung V-NAND 3-bit TLC\nTBW: 150 TB\nPhần mềm chuyển hệ điều hành đi kèm: SamSung Data Migration', 'SSD SamSung 980 PRO 250GB M2 NVMe MZ-V8P250BW', 2440000, 3.45121, 5, 27, '2021-07-02 20:50:25'),
(232, 'SSD', 'SSD Seagate® IronWolf® 110 được xây dựng cho NAS với dung lượng từ 240 GB đến 3,84 TB. Mỗi ổ đĩa bao gồm phần mềm AgileArray ™ để giữ cho vỏ NAS của bạn được tối đa hóa cho các môi trường 24 × 7 và nhiều người dùng yêu cầu, và có thể được sử dụng trong một mảng toàn flash (AFA) hoặc trong một NAS có khả năng lưu vào bộ đệm.', 'Nhà sản xuất: Seagate\nModel: IronWolf 110\nDung lượng: 240GB\nTốc độ đọc: 560 MB/s\nTốc độ ghi: 345 MB/s\nMTBF: 2.000.000h\nTBW: 435 TB 3D-Nand TLC\nBảo hành: 60 tháng chính hãng', 'SSD Seagate IronWolf 110 2,5 inch 240GB SATA III', 2490000, 2.79672, 5, 41, '2021-07-02 20:50:25'),
(233, 'SSD', '', 'Nhà sản xuất: Western Digital\nModel: WDS500G3X0C\nChuẩn giao tiếp: PCIe Gen3 x4\nKích thước: M.2 2280\nDung lượng: 240GB\nRandom 4K: 420.000 IOPs\nTốc độ đọc: 3470 Mb/s\nTốc độ ghi: 2600 Mb/s\nNAND Flash: SanDisk 64-layer 3D TLCTBW: 300 TB\n', 'SSD WD Black SN750 500GB M2 NVMe PCIe', 2790000, 4.51575, 5, 26, '2021-07-02 20:50:25'),
(234, 'SSD', '', 'Giao tiếp: 2.5\" \nGiao tiếp: SATA-III (6GB/s)\nBộ điều khiển: Marvell 88S1074\nNAND: 3D TLC\nĐọc/Ghi tuần tự: 240GB-960GB - lên đến 550-480 MB/s\nĐộ rung khi hoạt động: 2.17G Max (7-800Hz)\nĐộ rung khi không hoạt động: 20G Max (10-2000Hz)\nTuổi thọ: 1M giờ MTBF', 'SSD HyperX Fury RGB 480GB 2,5 Sata 3', 3350000, 4.12992, 5, 34, '2021-07-02 20:50:25'),
(235, 'SSD', 'Ổ Cứng Di Động SSD Seagate Firecuda Gaming 500GB USB-C được thiết kế và sản xuất bởi hãng Seagate (tên đầy đủ là Seagate Technology) là 1 trong những công ty chuyên về nghiên cứu, phát triển và sản xuất kho lưu trữ dự liệu lớn trên thế giới. Seagate được thành lập vào tháng 1 năm 1979 với tên ban đầu là Shugart Technology, công ty được hợp nhất tại Ai-len và có các văn phòng điều hành chính được đặt tại California, Mỹ từ năm 2010', 'Hãng sản xuất: Seagate\nMã sản phẩm: STJP500400\nDung lượng: 500GB\nKích thước (mm): 10 x 52.5 x 104.4 mm\nTrọng lượng: 0.1 kg\nHỗ trợ hệ điều hành: Windows 7, Windows 8, Windows 8.1, Windows 10, macOS\nKết nối: USB Type C', 'SSD Seagate Firecuda Gaming 500GB USB-C (STJP500400)', 3990000, 4.54417, 5, 51, '2021-07-02 20:50:25'),
(236, 'SSD', '', 'Nhà sản xuất: Gigabyte\n Kích thước: 2.5-inch internal SSD\n Chuẩn giao tiếp: PCI-Express 4.0x4, NVMe 1.3\n Dung lượng: 500GB\n Tốc độ đọc: Up to 5000 MB/s\n Tốc độ ghi: Up to 2500 MB/s\n NAND: 3D TLC Toshiba BiCS4\nExternal DDR Cache: DDR4 512MB', 'SSD Gigabyte AORUS NVMe Gen4 500GB (GP-ASM2NE6500GTTD)', 4550000, 4.40752, 5, 35, '2021-07-02 20:50:25'),
(237, 'SSD', 'Ổ Cứng Di Động - SSD Samsung T7 Touch Portable 1TB cung cấp cho bạn khả năng lưu trữ dữ liệu tiện dụng, cơ động cùng với tính năng bảo mật cao. Với kích thước nhỏ gọn, chỉ 2,5 inch vô cùng thuận tiện để mang theo mình, kịp thời lưu trữ dữ liệu khi cần thiết', 'Thương hiệu:: SAMSUNG\nMã sản phẩm:: MU-PC1T0K\nLoại:: Internal Solid State Drive (SSD) di động\nChuẩn kích cỡ:: 2.5 inch\nDung lượng:: 1TB\nGiao tiếp:: USB 3.2\nTốc độ đọc tối đa:: Up to 1050 MBps\nTốc độ ghi tối đa:: Up to 1000 MBps\nKích thước:: 7.6 x 86 x 56 mm\nTrọng lượng:: 57g', 'SSD Samsung T7 Touch Portable 1TB', 5590000, 4.69559, 5, 6, '2021-07-02 20:50:25'),
(238, 'SSD', 'Ổ cứng SSD PCIe NVMe KC2500 của Kingston mang lại hiệu năng mạnh mẽ vì sử dụng bộ điều khiển Gen 3.0 x 4 mới nhất và NAND TLC 3D 96 lớp. Với tốc độ đọc/ghi lên đến 3.500/2.900MB/giây, KC2500 cho độ bền xuất sắc và nâng cao hiệu suất công việc trên máy bàn, máy trạm và các hệ thống điện toán hiệu năng cao (HPC). Thiết kế M.2 nhỏ gọn linh hoạt hơn, tăng dung lượng lưu trữ và tiết kiệm không gian.', 'Kích cỡ: M.2 2280\nGiao tiếp: NVMe™ PCIe Gen 3.0 x 4 làn\nDung lượng: 250GB, 500GB, 1TB, 2TB\nBộ điều khiển: SMI 2262EN\nNAND: TLC 3D 96 lớp\nMã hóa: XTS-AES 256 bit\nĐọc/ghi tuần tự: 1TB – lên đến 3.500/2.900MB/giây\nĐọc/ghi 4K ngẫu nhiên: 1TB – lên đến 375.000/300.000 IOPS\nTổng số byte được ghi (TBW): 1TB – 600TBW\nTiêu thụ điện năng: 0,003W Nghỉ / 0,2W TB / 2,1W (MAX) Đọc / 7W (MAX) Ghi\nNhiệt độ bảo quản: -40°C~85°C\nNhiệt độ hoạt động: 0°C~70°C\nKích thước: 80mm x 22mm x 3,5mm\nTrọng lượng: 1TB – 10g\nĐộ rung hoạt động: 2,17G Tối đa (7-800Hz)\nĐộ rung khi không hoạt động: 20G Tối đa (20-1000Hz)\nMTBF: 2.000.000', 'SSD Kingston KC2500 1TB PCIe Gen 3', 5650000, 3.3857, 5, 35, '2021-07-02 20:50:25'),
(239, 'SSD', 'SSD FireCuda 510 cung cấp tốc độ lưu trữ game trên PC nhanh nhất để bạn mất ít thời gian tải cấp độ và bản đồ hơn, ít thời gian hồi sinh hơn và giảm tình trạng giật trong game thế giới mở.', 'Đọc / ghi tuần tự lên tới 3,450 / 3,200 MB/s\nYếu tố hình thức Slim M.2 2280\nNâng cấp lên tốc độ SSD cho máy tính xách tay và PC', 'SSD Seagate FireCuda 510 1TB – ZP1000GM30011', 6990000, 4.93566, 5, 43, '2021-07-02 20:50:25'),
(240, 'SSD', 'Ổ Cứng Di Động SSD Seagate Firecuda Gaming 2Tb USB-C được thiết kế và sản xuất bởi hãng Seagate (tên đầy đủ là Seagate Technology) là 1 trong những công ty chuyên về nghiên cứu, phát triển và sản xuất kho lưu trữ dự liệu lớn trên thế giới. Seagate được thành lập vào tháng 1 năm 1979 với tên ban đầu là Shugart Technology, công ty được hợp nhất tại Ai-len và có các văn phòng điều hành chính được đặt tại California, Mỹ từ năm 2010', 'Hãng sản xuất: Seagate\nMã sản phẩm: STJP2000400\nDung lượng: 2Tb\nKích thước (mm): 10 x 52.5 x 104.4 mm\nTrọng lượng: 0.1 kg\nHỗ trợ hệ điều hành: Windows 7, Windows 8, Windows 8.1, Windows 10, macOS\nKết nối: USB Type C', 'SSD Seagate Firecuda Gaming 2Tb USB-C (STJP2000400)', 14990000, 4.87286, 5, 25, '2021-07-02 20:50:25'),
(241, 'Speaker', 'Loa bluetooth 5.1', '- Hệ thống loa sound bar mới nhất và cao cấp nhất của hãng Harman/Kardon danh tiếng\n- Thích hợp treo bên dưới tivi (sound bar) và đặt phần sub dưới sàn nhà.\n- Chất lượng âm thanh tuyệt vời \n- Chất lượng âm thanh rõ ràng, độ chuẩn cao\n- Loa siêu trầm với công suất 120W cùng âm bass mạnh mẽ', 'Loa bluetooth Harman Kardon Omini Bar+', 24900000, 4.03872, 5, 14, '2021-07-02 20:50:25'),
(242, 'Speaker', 'Loa 5.1', '- Chất lượng âm thanh tinh tế, thiết kế cao cấp \n- Âm thanh vòm không dây 5.1 \n- Trải nghiệm đầy đủ âm thanh vòm  cùng loa siêu trầm không dây\n- Cập nhật liên tục tự động các tính năng mới \n- Kết nối không dây tiện lợi, dễ dàng mà không cần dây cắm', 'Loa 5,1 Harman Kardon CITATION SUB (Đen)', 21800000, 2.80005, 5, 45, '2021-07-02 20:50:25'),
(243, 'Speaker', '', '- Chất lượng âm thanh tinh tế, thiết kế cao cấp \n- Âm thanh vòm không dây 5.1 \n- Trải nghiệm đầy đủ âm thanh vòm  cùng loa siêu trầm không dây\n- Cập nhật liên tục tự động các tính năng mới \n- Kết nối không dây tiện lợi, dễ dàng mà không cần dây cắm', 'Loa Bluetooth JBL Party Box 100 (Black)', 9500000, 4.01025, 5, 43, '2021-07-02 20:50:25'),
(244, 'Speaker', 'Loa 2.1 ', '- Công suất hệ thống 300W ấn tượng\n- Loa siêu trầm không dây 5\" mang đến âm thanh sâu lắng, hồi hộp\n- Thưởng thức truyền phát nhạc không dây qua Bluetooth từ điện thoại di động hoặc máy tính bảng của bạn\n- Âm thanh vòm JBL mang lại trải nghiệm âm thanh tuyệt vời cho TV của bạn mà không cần thêm dây hoặc loa\n- Kết nối cáp quang hoặc cáp quang siêu đơn giản để thiết lập và sử dụng', 'Loa Bluetooth JBL Bar Deep Bass BAR21DBBLKAS (Đen)', 8900000, 4.8675, 5, 49, '2021-07-02 20:50:25'),
(245, 'Speaker', '', '- Chuẩn kết nối: Bluetooth 4.2 có kèm NFC \n- Sạc dự phòng tích hợp có thể sạc cho thiết bị khác \n- Chống nước chuẩn IPX4 \n- Driver 3.6\" Toàn dải \n- Thời lượng pin lên đến 16 giờ ', 'Loa bluetooth Bose Soundlink Revolve Plus (Đen)', 8490000, 4.47785, 5, 37, '2021-07-02 20:50:25'),
(246, 'Speaker', '', '- Âm thanh vòm 5.1 kênh chân thực cho các bộ phim thêm sống động \n- Truyền phát nhạc tức thời với khả năng nghe một chạm qua NFC hoặc Bluetooth \n- Âm thanh Dolby® Digital tích hợp', 'Loa bluetooth Sony HT-RT3 - MSP1 (Đen)', 6990000, 3.98052, 5, 17, '2021-07-02 20:50:25'),
(247, 'Speaker', '', '- Âm thanh thực sống động, công suất mạnh mẽ, hai loa cao, hai loa vệ tinh và một loa subwoofer \n - Chia sẻ, phát nhạc từ điện thoại hoặc máy tính bảng chỉ bằng một cái chạm qua Bluetooth hoặc NFC \n - Wifi tích hợp, kết nối thông minh chia sẻ dễ dàng cả phim ảnh và nhiều dữ liệu khác \n - Sắc nét với phong cách hoàn hảo, thưởng thức những bộ phim với hình ảnh chân thật', 'Loa bluetooth Sony BDV-E4100 - MSP1 (Đen)', 7990000, 2.53167, 5, 52, '2021-07-02 20:50:25'),
(248, 'Speaker', '', '- Loa không dây kết nối Bluetooth\n- Âm thanh kết nối âm thanh 9m, âm thanh 360 độ\n- Chuẩn kháng nước IPX4', 'Loa bluetooth Bose Soundlink Revolve (Đen)', 5990000, 3.70159, 5, 46, '2021-07-02 20:50:25'),
(249, 'Speaker', '', '- Công nghệ Bluetooth kết nối không dây nhanh chóng và dễ dàng. \n- A2DP 1.3, AVRCP 1.6 có thể kết nối streaming 2 thiết bị di động cùng lúc.\n- Pin Lithium-ion dung lượng 3.635 V/3283 mAh có thể sạc đầy trong 5 giờ \n- nghe nhạc liên tục 8 giờ với mức âm lượng trung bình.\n- Có khả năng chống nước IPX7', 'Loa Bluetooth Harman Kardon Onyx Studio 6 OS6BLKSG (Đen)', 4990000, 4.715, 5, 45, '2021-07-02 20:50:26'),
(250, 'Speaker', '', '- Loa không dây kết nối Bluetooth \n- Hỗ trợ giọng nói và Micro đàm thoại \n- Điều khiển bằng ứng dụng Bose connect \n- Thời lượng pin lên tới 8h', 'Loa bluetooth Bose Soundlink Color II (Xanh)', 3990000, 3.90752, 5, 36, '2021-07-02 20:50:26'),
