(261, 'VGA', 'Card màn hình ASUS RTX 3090 Rog Strix OC 24G đã được cải tiến hoàn toàn để phù hợp với các chip Ampere mới ấn tượng của NVIDIA và mang đến làn sóng đổi mới hiệu suất chơi game tiếp theo cho thị trường. Một thiết kế mới và nhiều kim loại hơn bao quanh một nhóm người hâm mộ công nghệ Axial.', 'Engine đồ họa: NVIDIA® GeForce RTX™ 3090\nChuẩn Bus: PCI Express 4.0\nBộ nhớ: 24GB GDDR6X \nMemory Speed: 19.5 Gbps\nLõi CUDA: 10496\nGiao diện bộ nhớ: 384-bit\nĐộ phân giải: Digital Max Resolution:7680x4320\nKích thước: 31.85 x 14.01 x 5.78 \nPSU đề nghị: 750W\nPower Connectors: 3 x 8-pin', 'VGA ASUS GeForce RTX 3090 Rog Strix OC 24G Gaming', 51990000, 4.37424, 5, 52, '2021-07-02 20:50:26'),
(262, 'VGA', 'Card màn hình MSI RTX 3090 VENTUS 3X OC 24G là một trong những sản phẩm cao cấp nhất của MSI phục vụ cho nhu cầu gaming ở độ phân giải 4K 60Fps. Đây là card đồ họa sử dụng kiến trúc Ampare hoàn toàn mới cùng nhân RT thế hệ 2, nhân Tensor thế hệ 3, Nvidia RTX IO, VRAM GDDR6X và sản xuất trên tiến trình 8nm được Samsung làm riêng. ', 'MODEL NAME: GeForce RTX™ 3090 VENTUS 3X 24G OC\nGRAPHICS PROCESSING UNIT: NVIDIA® GeForce RTX™ 3090\nINTERFACE: PCI Express® Gen 4\nCORES: 10496\nCORE CLOCKS: 1725 MHz\nMEMORY SPEED: 19.5 Gbp\nMEMORY: 24GB GDDR6\nMEMORY BUS: 384-bit\nOUTPUT: DisplayPort x 3 (v1.4a) / HDMI 2.1 x 1\nHDCP SUPPORT: Y\nPOWER CONSUMPTION: TBD\nPOWER CONNECTORS: 8-pin x 2\nRECOMMENDED PSU: 750W\nCARD DIMENSION (MM): 305 x 120 x 57 mm\nWEIGHT (CARD / PACKAGE): 1387g / 2004G\nDIRECTX VERSION SUPPORT: 12 API\nOPENGL VERSION SUPPORT: 4.6\nNVLINK SUPPORT: Y\nMAXIMUM DISPLAYS: 4\nVR READY: Y\nG-SYNC TECHNOLOGY: Y\nADAPTIVE VERTICAL SYNC: Y\nDIGITAL MAXIMUM RESOLUTION: 7680x4320', 'VGA MSI GeForce RTX 3090 VENTUS 3X 24G OC', 44990000, 4.38294, 5, 36, '2021-07-02 20:50:26'),
(263, 'VGA', 'Updating...', 'Model name: GeForce RTX™ 2080 Ti\nCore Clock: 1770 MHz (Reference card: 1545 MHz)\nCUDA Cores: 4352\nCard Bus: PCI-E 3.0 x 16\nMemory Clock: 14140 MHz\nMemory size: 11GB\nMemory type: GDDR6\nMemory Bus: 352-bit\nMemory Bandwidth (GB/sec): 616 GB/s\nRecommended PSU: 750W\nCard size: 290 x 134.31 x 59.9 mm\nPCB Form: ATX\nOpenGL: 4.5\nDirectX: 12\nMulti-view: 4\nDIGITAL MAXIMUM RESOLUTION: 7680x4320@60Hz', 'VGA AORUS GeForce® RTX 2080 Ti XTREME 11G GDDR6', 35990000, 2.52206, 5, 49, '2021-07-02 20:50:26'),
(264, 'VGA', 'Updating...', 'MODEL NAME: GeForce RTX™ 2080 Ti GAMING Z TRIO\nGRAPHICS PROCESSING UNIT: NVIDIA® GeForce RTX™ 2080 Ti\nINTERFACE: PCI Express x16 3.0\nCORES: 4352 Units\nCORE CLOCKS: 1755 MHz\nMEMORY SPEED: 16 Gbps\nMEMORY: 11GB GDDR6\nMEMORY BUS: 352-bit\nOUTPUT: DisplayPort x 3 (v1.4) / HDMI 2.0b x 1 / USB Type-C x1\nHDCP SUPPORT: Y\nPOWER CONSUMPTION: 300 W\nPOWER CONNECTORS: 8-pin x 2, 6-pin x 1\nRECOMMENDED PSU (W): 650 W\nCARD DIMENSION(MM): 328 x 140 x 57 mm\nWEIGHT (CARD / PACKAGE): 1545 g / 2413 g\nDIRECTX VERSION SUPPORT: 12 API\nOPENGL VERSION SUPPORT: 4.5\nMULTI-GPU TECHNOLOGY: NVIDIA NVLINK™ (SLI-Ready), 2-way\nMAXIMUM DISPLAYS: 4\nVR READY: Y\nG-SYNC™ TECHNOLOGY: Y\nADAPTIVE VERTICAL SYNC: Y\nDIGITAL MAXIMUM RESOLUTION: 7680 x 4320', 'VGA MSI RTX 2080 Ti GAMING Z TRIO 11GB', 34590000, 4.76862, 5, 20, '2021-07-02 20:50:26'),
(265, 'VGA', 'Card màn hình - VGA Gigabyte AORUS GeForce RTX 3080 MASTER 10G được xây dựng dựa trên kiến trúc Ampere hoàn toàn mới của NVIDIA mang đến những trải nghiệm đỉnh cao với độ trung thực hình ảnh của tính năng dò tia theo thời gian thực và hiệu suất tối ưu của DLSS được hỗ trợ bởi AI.', 'Graphics Processing: GeForce RTX™ 2080\nCore Clock: 1815  MHz\nCUDA® Cores: 2944\nMemory Clock: 14000 MHz\nMemory Size: 8 GB\nMemory Type: GDDR6X\nMemory Bus: 256 bit\nMemory Bandwidth (GB/sec): 448 GB/s\nPCI-E 3.0\n240Hz Max Refresh Rate\nDigital max resolution: 7680x4320\nMulti-view: 4\nOpenGL: 4.6\nDirectX: 12API\nRecommended PSU: 650W\nPower Connectors: 6 pin*2', 'VGA EVGA GeForce RTX 2080 XC ULTRA GAMING 8GB GDDR6', 25990000, 4.78973, 5, 17, '2021-07-02 20:50:26'),
(266, 'VGA', 'Updating...', 'Chipset: GeForce® RTX 2080 SUPER™\nCore Clock: 1860 MHz (Reference Card: 1815 MHz)\nRTX-OPS: 65\nCUDA® Cores: 6072\nMemory Clock: 15500 MHz\nMemory Size: 8GB\nMemory Type: GDDR6\nMemory Bus: 256 bit\nMemory Bandwidth (GB/sec): 496GB/s\nCard Bus: PCI-E 3.0 x 16\nDigital max resolution: 7680x4320@60Hz\nMulti-view: 4\nCard size: L=291.29 W=159.05 H=28.7 mm\nPCB Form: ATX\nDirectX: 12\nOpenGL: 4.5\nPower requirement: 650W\nPower Connectors: 8 pin*2\nOutput: DisplayPort 1.4 *3 | HDMI 2.0b *3 | USB Type-C™(support VirtualLink™) *1\nSLI support: 2-way NVIDIA NVLINK™\nFitting type: G1/4', 'VGA AORUS GeForce® RTX 2080 SUPER™ WATERFORCE WB 8G', 24590000, 3.75418, 5, 26, '2021-07-02 20:50:26'),
(267, 'VGA', 'Card màn hình MSI RTX 3070 VENTUS 3X OC được tạo ra bởi kiến trúc Ampere — kiến trúc RTX thế hệ thứ 2 của NVIDIA. Được xây dựng với nhân RT và nhân Tensor nâng cao, bộ xử lý phát trực tuyến mới và bộ nhớ G6 tốc độ cao đem lại cho bạn sức mạnh cần thiết để chiến các trò chơi đòi hỏi cấu hình cao nhất.', 'MEMORY: 8GB GDDR6\nVI XỬ LÝ ĐỒ HỌA: NVIDIA® GeForce RTX™ 3070\nCHUẨN GIAO TIẾP: PCI Express® Gen 4\nBUS BỘ NHỚ: 256-bit\nXUNG NHỊP NHÂN ĐỒ HỌA(MHZ): TBD\nXUNG NHỊP BỘ NHỚ (MHZ): TBD\nHỖ TRỢ MÀN HÌNH TỐI ĐA: 4\nG-SYNC™ TECHNOLOGY: Y\nADAPTIVE VERTICAL SYNC: Y\nHỖ TRỢ HDCP: Y\nCÔNG SUẤT TIÊU THỤ (W): TBD\nOUTPUT: DisplayPort x 3 (v1.4a) / HDMI 2.1 x 1\nCÔNG SUẤT NGUỒN ĐỀ NGHỊ (W): TBD\nVIRTUAL REALITY READY: Y\nDIGITAL MAXIMUM RESOLUTION: 7680 x 4320\nNGUỒN PHỤ: 8-pin x 2\nHỖ TRỢ PHIÊN BẢN DIRECTX: 12 API\nHỖ TRỢ PHIÊN BẢN OPENGL: 4.6\nKÍCH THƯỚC (MM): 305 x 121 x 52 mm', 'VGA MSI GeForce RTX 3070 VENTUS 3X OC', 17490000, 4.2225, 5, 19, '2021-07-02 20:50:26'),
(268, 'VGA', '', 'Chipset: GeForce® RTX 2070 SUPER™\nCore Clock: TBD\nCUDA® Cores: 2560\nMemory Clock: 14000MHz\nMemory Size: 8 GB\nMemory Type: GDDR6\nMemory Bus: 256 bit\nMemory Bandwidth (GB/sec): 448 GB/s\nCard Bus: PCI-E 3.0 x 16\nDigital max resolution: 7680x4320@60Hz\nMulti-view: 4\nCard size: L=290 W=134.31 H=59.9 mm\nPCB Form: ATX\nDirectX: 12\nOpenGL: 4.5\nPower requirement: 650W\nPower Connectors: 8 Pin*2\nSLI support: 2-way NVIDIA NVLINK™', 'VGA GIGABYTE GeForce RTX™ 2070 SUPER AORUS 8G', 16490000, 4.55674, 5, 60, '2021-07-02 20:50:26'),
(269, 'VGA', 'Card màn hình Asus Rog Strix GeForce RTX 2080 Super OC edition 8GB GDDR6 (ROG-STRIX-RTX2080S-O8G-GAMING) là mẫu card đồ họa cận cao cấp mới nhất của ASUS, sử dụng bộ xử lý đồ họa RTX 2080 với hiệu năng chơi game tương đương với GTX 1080Ti, cùng với việc hỗ trợ nhiều công nghệ mới như DLSS, Ray tracing, VRS đem lại trải nghiệm chơi game mượt mà trên độ phân giải lớn như 1440p thậm chí là 4K (2160p)', 'RT Cores: Dedicated ray tracing hardware enables fast real-time ray tracing of objects and environments with physically accurate shadows, reflections, refractions, and global illumination.\nConcurrent Floating Point and Integer Processing: Turing GPUs more efficiently process the compute heavy workloads of modern games.\nUltra-fast GDDR6: Experience up to 496 GB/s of memory bandwidth for high-speed, high-resolution gaming.\nAxial-tech fan design features a smaller fan hub that facilitates longer blades and a barrier ring that increases downward air pressure.\n0dB Technology lets you enjoy light gaming in relative silence.\n2.7-slot Design expands cooling surface area to make the most of the three powerful Axial-tech fans.\nAuto-Extreme Technology uses automation to enhance reliability.\nA reinforced frame prevents excessive torsion and lateral bending of the PCB.\nGPU Tweak II provides intuitive performance tweaking, thermal controls, and system monitoring.\nAura Sync compatibility lets you customize and sync lighting effects with other compatible hardware.', 'VGA ROG Strix GeForce® RTX 2080 SUPER™ OC edition 8GB GDDR6', 21890000, 4.15032, 5, 6, '2021-07-02 20:50:26'),
(270, 'VGA', 'RTX 2080 là một GPU cực kì mạnh mẽ thuộc thiết trúc Turing đời mới. Và mạnh mẽ thông thường sẽ sản xuất lượng nhiệt năng tương đối lớn trong khi phải phát huy hết 100% công lực, khiến cho công việc ổn định nhiệt độ hoạt động bình thường là tối quan trọng.\nĐiều đó khiến các hãng linh kiện PC không chỉ tập trung vào những thiết kế tản nhiệt hạng nặng TriFan như MSI RTX 2080 Gaming X Trio, Gigabyte RTX 2080 Windforce... mà ngay cả cái tên cũng như muốn nhấn mạnh vào khả năng tản nhiệt khủng cho card màn hình. MSI GeForce RTX 2080 VENTUS 8G OC là một sản phẩm như vậy. Bắt nguồn từ tên gọi của vị thần gió, thần của 4 mùa, thần của những con bão trong thần thoại của người Roman, MSI dường như rất tự tin trong cuộc đua về tản nhiệt lần này', 'Engine đồ họa: GeForce RTX 2080\nBộ nhớ: 8GB GDDR6\nGiao diện bộ nhớ: 256 bit\nKết nối: DisplayPort 1.4 *3, HDMI 2.0b *1\nPSU đề nghị: 650W\nPower Connectors: 8 Pin*1, 6 Pin*1', 'VGA MSI RTX 2080 VENTUS 8GB V2', 18990000, 4.85198, 5, 9, '2021-07-02 20:50:26'),
(271, 'VGA', 'Card đồ họa - VGA GIGABYTE GeForce RTX 2070 SUPER GAMING OC 3X 8G với hệ thống làm mát WINDFORCE 3X sở hữu cánh quạt độc đáo 3x 82mm, vận hành quay xen kẽ cùng với 6 ống dẫn nhiệt bằng đồng composite, cảm ứng trực tiếp ống dẫn nhiệt và chức năng quạt hoạt động 3D. Hồ trợ và mang đến khả năng tản nhiệt hiệu quả cho hiệu suất cao hơn ở nhiệt độ thấp hơn.', 'Chipset: GeForce® RTX 2070 SUPER™\nCore Clock: 1815 MHz (Reference Card: 1770 MHz)\nRTX-OPS: 53\nCUDA® Cores: 2560\nMemory Clock: 14000 MHz\nMemory Size; 8 GB\nMemory Type: GDDR6\nMemory Bus: 256 bit\nMemory Bandwidth (GB/sec): 448 GB/s\nCard Bus: PCI-E 3.0 x 16\nDigital max resolution: 7680x4320@60Hz\nMulti-view: 4\nCard size: L=286.5 W=114.5 H=50.2 mm\nPCB Form: ATX\nDirectX: 12\nOpenGL: 4.6\nPower requirement: 650W\nPower Connectors: 8 Pin*1, 6 Pin*1', 'VGA GIGABYTE GeForce RTX 2070 SUPER GAMING OC 3X 8G', 14990000, 3.75218, 5, 40, '2021-07-02 20:50:26'),
(272, 'VGA', '', 'CUDA Parallel Processing cores: 1280\nFrame Buffer Memory: 5 GB GDDR5x\nPeak Single Precision (FP32) Performance: Up to 3.8 TFLOPS\nMemory Interface: 160-bit\nMemory Bandwidth: Up to 200 GB/s\nMax Power Consumption: 75 W\nGraphics Bus: PCI Express 3.0 x 16\nDisplay Connectors: DP 1.4 (4)\nForm Factor: 4.4” H x 7.9” L Single Slot\nProduct Weight: 256 g\nThermal Solution: Active', 'VGA NVIDIA QUADRO P2200 5GB GDDR5X', 11300000, 3.94462, 5, 18, '2021-07-02 20:50:26'),
(273, 'VGA', '', 'Chipset: GeForce GTX 1660 Ti\nCore Clock: 1890 MHz (Reference card is 1770 MHz)\nCUDA Cores: 1536\nMemory Clock: 12000 MHz\nMemory Size: 6GB\nMemory Type: GDDR6\nMemory Bus: 192 Bit\nMemory Bandwidth (GB/s): 288 BG/s\nCard Bus: PCI-E 3.0 x 16\nDigital max resolution: 7680x4320@60Hz\nMulti-view: 4\nCard size: L=280 W=120.1 H=40.5 mm\nPower requirement: 450 W\nPower connection: 8 pin*1', 'VGA AORUS GeForce GTX™ 1660 Ti 6G GDDR6', 8790000, 4.16032, 5, 32, '2021-07-02 20:50:26'),
(274, 'VGA', '', 'Graphics Processing: Radeon™ RX 5600 XT\nCore Clock: Boost Clock : up to 1620 MHz\nGame Clock : 1560 MHz\nStream Processors: 2304\nProcess Technology: 7 nm\nMemory Clock: 12000 MHz\nMemory Size: 6 GB\nMemory Type; GDDR6\nMemory Bus: 192 bit\nMemory Bandwidth (GB/sec): 288 GB/s\nCard Bus: PCI-E 4.0 x 16\nDigital max resolution: 7680x4320@60Hz\nMulti-view: 4\nCard size: L=279.85 W=114.35 H=49.55 mm\nPCB Form: ATX\nDirectX: 12\nOpenGL: 4.6\nRecommended PSU: 450W\nPower Connectors: 8 Pin*1', 'VGA GIGABYTE AMD Radeon™ RX 5600 XT GAMING OC 6G', 7990000, 2.90738, 5, 43, '2021-07-02 20:50:26'),
(275, 'VGA', '', 'Graphics Processing: GeForce® GTX 1660 SUPER™\nCore Clock: 1860 MHz (Reference Card: 1785 MHz)\nCUDA® Cores: 1408\nMemory Clock: 14000 MHz\nMemory Size: 6 GB\nMemory Type: GDDR6\nMemory Bus: 192 bit\nMemory Bandwidth (GB/sec): 336 GB/s\nCard Bus: PCI-E 3.0 x 16\nDigital max resolution: 7680x4320@60Hz\nMulti-view: 4\nCard size: L=280 W=116.7 H=40.4 mm\nPCB Form: ATX\nDirectX: 12\nOpenGL: 4.6\nRecommended PSU: 450W\nPower Connectors: 8 Pin*1', 'VGA Gigabyte GeForce® GTX 1660 SUPER™ GAMING OC 6GB GDDR6', 6790000, 3.93511, 5, 15, '2021-07-02 20:50:26'),
(276, 'VGA', '', 'MODEL NAME: GeForce® GTX 1650 SUPER™ GAMING X\nGRAPHICS PROCESSING UNIT: NVIDIA® GeForce® GTX 1650 SUPER™\nINTERFACE: PCI Express x16 3.0\nCORES: 1280 Units\nCORE CLOCKS: Boost:1755MHz\nMEMORY SPEED: 12 Gbps\nMEMORY: 4GB GDDR6\nMEMORY BUS: 128-bit\nOUTPUT: DisplayPort x 3 (v1.4) / HDMI 2.0b x 1\nHDCP SUPPORT: 2.2\nPOWER CONSUMPTION: 100 W\nPOWER CONNECTORS: 6-pin x 1\nRECOMMENDED PSU: 350 W\nCARD DIMENSION(MM): 248 x 127 x 44 mm\nWEIGHT (CARD / PACKAGE): 742 g / 1371 g\nDIRECTX VERSION SUPPORT: 12 API\nOPENGL VERSION SUPPORT: 4.6\nMAXIMUM DISPLAYS: Y\nVR READY: Y\nG-SYNC® TECHNOLOGY: Y\nADAPTIVE VERTICAL SYNC: Y\nDIGITAL MAXIMUM RESOLUTION: 7680x4320', 'VGA MSI GTX 1650 Super GAMING X 4GB GDDR6', 5390000, 4.87637, 5, 37, '2021-07-02 20:50:26'),
(277, 'VGA', '', 'GRAPHICS PROCESSING: GeForce® GTX 1050 Ti\nINTERFACE: PCI Express x16 3.0\nCORES: 768 Units\nCORE CLOCKS: 1468 MHz\nMEMORY: 4GB GDDR6\nMEMORY BUS: 128-bit\nPOWER CONNECTORS: 6-pin x 1\nRECOMMENDED PSU: 300 W\nCARD DIMENSION(MM): 229 x 118 x 40 mm\nDIRECTX VERSION SUPPORT: 12 API\nOPENGL VERSION SUPPORT: 4.5\nMULTI-VIEW: 4\nDIGITAL MAXIMUM RESOLUTION: 7680x4320', 'VGA GIGABYTE GTX 1050 Ti WindForce OC 4GB GDDR5 128bit', 4690000, 4.69532, 5, 10, '2021-07-02 20:50:26'),
(278, 'VGA', '', 'Engine đồ họa: NVIDIA® GeForce GTX 1650\nChuẩn Bus: PCI Express 3.0\nOpenGL: OpenGL®4.5\nBộ nhớ: GDDR5 4GB\nXung nhịp của nhân: Chế độ OC - Xung Tăng cường GPU : 1695 MHZ , Xung Nền GPU : 1485 MHz\nChế độ Chơi Game - Xung Tăng cường GPU : 1665 MHZ , Xung Nền GPU : 1485 MHz\nLõi CUDA: 896\nClock bộ nhớ: 8002 Mhz\nĐộ phân giải: 128-bit\nGiao tiếp: Đầu ra DVI : Có x 1 (Tự nhiên) (DVI-D)\nĐầu ra HDMI : Có x 1 (Tự nhiên) (HDMI 2.0b)\nCổng hiển thị : Có x 1 (Tự nhiên) (DisplayPort 1.4)\nHỗ trợ HDCP : Có\nHỗ trợ hiển thị tối đa: 3\nHỗ trợ NVlink/ Crossfire: Không\nPSU khuyến cáo: 300W', 'VGA ASUS GeForce GTX 1650 4GB DUAL', 3990000, 3.11964, 5, 37, '2021-07-02 20:50:26'),
(279, 'VGA', '', 'GRAPHICS PROCESSING: GeForce® GTX 2070\nINTERFACE: PCI Express x16 3.0\nCORES: 2304 Units\nCORE CLOCKS: TBD\nMEMORY SIZE: 8GB GDDR6\nMEMORY BUS: 256-bit\nMEMORY BANDWIDTH: 448 GB/s\nRECOMMENDED PSU: TBD\nCARD SIZE: TBD\nDIRECTX VERSION SUPPORT: 12 API\nOPENGL VERSION SUPPORT: 4.5\nMULTI-VIEW: 4\nDIGITAL MAXIMUM RESOLUTION: 7680x4320', 'VGA GIGABYTE GeForce® RTX 2070 GAMING OC 8G', 16290000, 3.55197, 5, 19, '2021-07-02 20:50:26'),
